 za revizija na privatizacijata vo 90 tite godini,za TAT,za narko dilerot Frckovski koj namesto da ja unisti drogata ja prodade preku Albanija vo Italija,za Velesta,za Fersped i t.n.Vmrovcite se pokazaa golemi prakticari,a SDSMovskite kadri sve vrskadzii ne se sposobni za prakticen zivot.Primer Deskoska, Brankov kadar,nejzinite rabotea za Branko i na toj nacin bese ona primena na Praven fakultet,koj sto e leglo na sdsmovci.Sto ocekuvate od takva nesposobna zena koja nema vrska so prakticniot zivot,taa e samo eden primer koj go navedov poradi nejzinata eksponiranost,zasto ako gi nabrojuvam site tekstot ke bide predolg.Materijalnoto se nadohnaduva,ama ako ja izgubime drzavata,a odite kon toa(dali ste svesni e drugo prasanje)togas ne znam kolku ke vi koristat vasite VANDALSKI ispadi denovive,se` mi se cini deka svesno odite na unistuvanje na Makedonija zasto postapkite vasi dokazuvaat deka sakate da dojdete na vlast ne vodejki racun za posledicite,a pri toa svesni ste deka makedonskiot narod ne ve saka,barem letoto koga bev vo Makedonija go vidov raspolozenieto na narodot.','2016-04-15 11:23:22','148427235188637','1126106924087325'),('1126106924087325_1126760170688667','Vera Veci',1073190112754111,'Се сложувам, а полициска бруталност да нема?','2016-04-15 17:36:15','148427235188637','1126106924087325'),('1126767720687912_1126769300687754','Dzevat Etem',184183251970900,'','2016-04-15 17:58:30','148427235188637','1126767720687912'),('1126767720687912_1126771157354235','Fadil Bajrami',216523652060146,'Taka sampionu','2016-04-15 18:03:11','148427235188637','1126767720687912'),('1126767720687912_1126817797349571','Naser Shabani',1595155894143236,'Gi posdravuvam site vistinski gradjani na Makedonija nema da ima izbori na 5 juni a ako saka gruevski i negovata zboram \" negovata \" vmro a ne za drugite neka se sam izbere pa da vidime kolku qe e legitimen ne samo vo Makedonija tuku i vo Svetov sto znaci toa deka qe bideme zatvorenici na gruevski a sigurno pak qe ni gi vratat vi