shkollen fillore  te  bleme  -  shkollat e mesme te  bleme  dhe   fakulltetet  e bleme      shkoni shkollonu  edhe mirruni me politik   -- BDI  -','2015-11-22 16:04:59','130194893722510','912925295449462'),('912925295449462_912940492114609','Culi Sadiku',969664519788401,'Pdsh se arber xhaferit po','2015-11-22 16:27:38','130194893722510','912925295449462'),('912925295449462_912989908776334','Lanuci Pizziani',1089667857742456,'më se e vertet 🙌','2015-11-22 18:55:32','130194893722510','912925295449462'),('914388995303092_914398828635442','Merfis Jusufi',904823696282992,'Lutje ben thaqi bdin ne koalicion ska mare as turp largoju o kryetar ste do askushi ma','2015-11-25 19:10:41','130194893722510','914388995303092'),('916996498375675_917029141705744','Mirsad Raveni',1048836191846367,'Fitoren e kemi zoti Kryetar vetem perpara se perkrahjen e luanave e ke','2015-12-01 01:24:58','130194893722510','916996498375675'),('916996498375675_917263198349005','Sedat Shkupi',1024467654286976,'kryetar deni nfund me pdsh','2015-12-01 15:23:16','130194893722510','916996498375675'),('916996498375675_917314821677176','De-Gama De-Gama',436546726538280,'','2015-12-01 17:31:36','130194893722510','916996498375675'),('930308117044513_930567350351923','Arburim Selimi',1043895912299577,'Kam prit se do te jeni me te zeshem ne ket koh,por me duket spo ju ndihet zeri hiq karshi politikes maqedone.','2015-12-25 09:43:30','130194893722510','930308117044513'),('951849141557077_952231418185516','Nouchi Rusidi',1293070294039630,'Rrofshi topat','2016-02-02 08:51:26','130194893722510','951849141557077'),('958250000916991_958251834250141','Merfis Jusufi',904823696282992,'Shkriet pdsh largoju kryetar te ri duet ky nuk ndaet nga grueski','2016-02-12 16:51:59','130194893722510','958250000916991'),('960669254008399_960681970673794','Veli Memeti',1086957081335905,'Çka lyp Nishani të takohet me Thaçin, kur nuk ësht i të njejti rang. Mjafjt më me zhvillimin e kriminalitetit.','2016-02-16 17:21:05','130194893722510','960669254008399'),('960669254008399_960721184003206','Lanuci Pizziani',1089667857742456,'Veli Memeti tema esht e \"MARVESHJES\" kurse vizita ?!!? pun biznesi','2016-02-16 18:38:44','130194893722510','960669254008399'),('976412025767455_976485835760074','Veli Memeti',1086957081335905,'Po ikni në Turqi nëse ju mungon Erdogani, ne dot qeverisemi nga argatët e popullit, sado të kqij me qen pushtetarët shqiptar. Ne si qytetar të thjesht në kët vend të bekuar gjithmon dot punojm dhe dot luftojm për liri dhe nuk doti lusim vendet tjera për shkaqe pushteti dhe ta paguajm me okupim. Okupimi nuk ka lidhje  nga cili popull po qeverisesh apo viddhesh, grek, bullgar serb, malazez, italian apo turk, okupimi është  okupim dhe nuk ushtë liri, të cëgohet qenja e të qenurit njeri. Këtë e praktikojn vetëm pushtetarët që  nuk kan aftësi politike që të fitojn simpati ndaj popullit për ta fituar votat për qeverisjen e shtetit. Kështu pushtetarët e dobët gjithmon kërkojn përkrahje nga jasht ku pastaj populli e paguan pa aftësin e politikanit me gjak. Kjo është poshtërsi për politikanët që jetojn nga populli.','2016-03-14 19:20:39','130194893722510','976412025767455'),('976412025767455_976503889091602','Maliqi Xhemail',532928720228181,'Turpi për kta flliqana.','2016-03-14 19:58:19','130194893722510','976412025767455');
