INSERT INTO `post` VALUES ('1000065936735397','https://www.facebook.com/275355619167100/photos/a.363997486969579.74789.275355619167100/1013134982055823/?type=3','','2016-04-12 11:19:00',0,3,0,3,'130194893722510'),('1002135926528398','http://www.shqipmedia.com/menduh-thaci-realizoi-takim-ambasadorin-jan-petersen/','','2016-04-15 14:12:57',0,8,0,8,'130194893722510'),('1002206083188049','https://www.facebook.com/pdsh.info/photos/a.133021743439825.31964.130194893722510/1002206083188049/?type=3','Letër e Partisë Demokratike Shqiptare drejtuar Presidentit të Republikës së Maqedonisë Gjorgje Ivanov\n\nPartia Demokratike Shqiptare, në cilësinë e nënshkrueses se Marrëveshjes së 2 Qershorit dhe Protokolit të 15 Korrikut, kërkon nga Ju t\'a tërhiqni vendimin për Abolim të datës 13 Prill 2016. \n \nPartia Demokratike Shqiptare vlerëson se anulimi i vendimit në fjalë do të kontribojë në tejkalimin e situatës së krijuar si dhe do të mundësonte që nëpërmjet një procesi transparent dhe të paanshëm dhe në rrugë institucionale të trajtohen të gjitha rastet. \n\nPartia Demokratike Shqiptare vazhdon të jetë e përkushtuar për realizim të plotë të Marrëveshjes së aritur në mes katër partive politike ne vend me ndërmjetësim të Shteteve të Bashkuara të Amerikës dhe Bashkimit Europjan. \n\nPartia Demokratike Shqiptare','2016-04-15 16:27:13',0,21,0,21,'130194893722510'),('10154163656944260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154163656944260/?type=3','Отчетно✔! Ова е разликата! Вака се сака Македонија!','2016-04-01 07:59:00',22,198,2,222,'90137764259'),('10154163657409260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154163657409260/?type=3','Отчетно✔! Ова е разликата! Вака се сака Македонија!','2016-04-01 10:59:01',21,163,0,184,'90137764259'),('10154163657929260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154163657929260/?type=3','Отчетно✔! Ова е разликата! Вака се