04-03 10:30:00',304,537,57,898,'90137764259'),('10154163726314260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154163726314260/?type=3','Отчетно✔! Ова е разликата! Вака се сака Македонија!','2016-04-03 17:00:01',436,573,90,1099,'90137764259'),('10154171776859260','http://vmro-dpmne.org.mk/?p=33096','Интересот за проектот „Купи куќа за млади“ ги надминува очекувањата. Граѓаните секојдневно се информираат во подрачните канцеларии за можностите кои ги нуди овој проект, додека канцеларијата во Министерството за финансии дневно ја посетуваат околу 80 лица. Голема е и посетеноста на презентациите на караванот кој го организира министерството, каде граѓаните во директна комуникација со надлежните, но и банкарите, се информираат за проектот.','2016-04-01 09:47:59',431,861,98,1390,'90137764259'),('10154171881999260','http://vmro-dpmne.org.mk/?p=33099','Од денеска стапуваат на сила новите намалени цени на 165 лекови\n(Никола Тодоров)','2016-04-01 10:27:00',5,149,1,155,'90137764259'),('10154172194189260','http://vmro-dpmne.org.mk/?p=33103','Катастарот воведе  ВИП постапка за регистрација на имот со која  пренесувањето на недвижност од едно на друго лице се врши во три чекори за шест дена. Разликата во цената со постоечката постапка, со која активностите се во седум чекори и траат 30 дена, е од 3.000 до 6.000 денари','2016-04-01 12:30:48',312,455,60,827,'90137764259'),('10154172261364260','http://vmro-dpmne.org.mk/?p=33106','Природата на безбедносните предизвици бара подобрена и сестрана соработка меѓу земјите и сите засегнати страни. Македонија се докажа како сериозен партнер во справувањето со безбедносните предизвици. Ние ги споделуваме проценките за безбедноста и континуирано даваме значаен придонес кон евроатлантската стабилност. Активно придонесуваме и во рамките на колективните напори за справување со современите предизвици, закани и ризици.','2016-04-01 13:45:00',12,186,2,200,'90137764259'),('10154172289364260','http://vmro-dpmne.org.mk/?p=33109','Работен состанок за основање Совет на архиви на Југоисточна Европа се одржува денеска во организација на Државниот архив на Република Македонија, кој одбележува 65 години од формирањето\nЕлизабета Канческа Милевска FILIP PETROVSKI','2016-04-01 13:11:22',261,458,51,770,'90137764259'),('10154172313084260','http://vmro-dpmne.org.mk/?p=33113','Не запира неизбалансираното информирање на дел од медиумите на кои илјадници секунди секој ден добиваат манипулациите и насоките од СДСМ и нивните фабрики за афери','2016-04-01 13:29:08',9,129,0,138,'90137764259'),('10154172442509260','http://vmro-dpmne.org.mk/?p=33114','Пред сигурнот пораз на изборите се зголемува тензијата, очајот и паниката во СДСМ па продолжуваат невидените срамни пресметки на СДСМ со Уставниот суд.\n\nНа сила е и понатаму срамното сценарио на СДСМ за создавање алиби за бегство од избори, за нивно одложување или непризнавање на резултатите.','2016-04-01 14:15:39',7,228,3,238,'90137764259'),('10154172792024260','http://vmro-dpmne.org.mk/?p=33119','Растот на индустриското производство во февруари од 15,2 отсто е одличен податок и претставува најголем раст за последните пет години. Растот покажува дека има сериозно раздвижување на индустријата, а истовремено се објави дека и вработеноста во индустријата е зголемена за 1,6 отсто во споредба со истиот месец од минатата година, што значи дека работите во економијата се движат во одлична насока. И покрај тоа што државата е под притисок на политичката криза, сепак, добро поставените економски политики, преземените мерки од страна на Владата, реформите што беа направени, натамошните мерки што ќе следуваат придонесуваат да имаме одличен раст на економијата','2016-04-01 16:34:01',4,91,0,95,'90137764259'),('10154172797824260','http://vmro-dpmne.org.mk/?p=33119','','2016-04-01 16:40:00',0,52,1,53,'90137764259'),('10154172851599260','http://vmro-dpmne.org.mk/?p=33123','Во последните осум намалувања на цените на лековите се направи заштеда од 33 милиони евра за граѓаните. Тие пари наместо да отидат во џебовите на одредени фармацевтски олигарси, останаа во џебовите на граѓаните. Наместо да ги потрошат за лекови, граѓаните ги заштедија. Тоа е главниот бенефит. Ќе продолжиме и понатаму со истражување на пазарот и можностите за намалување на цените на лековите, изјави лидерот на ВМРО-ДПМНЕ Nikola Gruevski во одговор на прашање по пуштањето во употреба на новите простории на Државниот архив и МВР во Куманово, сместени во реновираниот објект на поранешниот Дом на АРМ','2016-04-01 17:07:01',14,238,0,252,'90137764259'),('10154173046699260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154173046699260/?type=3','Пуштен во употреба реконструираниот објект кој ќе биде ставен на располагање на Државниот архивна РМ и МВР во Куманово, петок, 1 април 2016','2016-04-01 18:08:26',139,1553,17,1709,'90137764259'),('10154173210084260','http://vmro-dpmne.org.mk/?p=33125','Соопштението на СДСМ очигледно е во духот на 1 април бидејќи изобилува со лаги, манипулации и терање мајтап со граѓаните на Република Македонија\n\nДа зборува СДСМ за пензионерите, земјоделците и лицата кои примаат социјална помош е во најмала рака лицемерно','2016-04-01 18:55:55',20,196,0,216,'90137764259'),('10154173213534260','http://vmro-dpmne.org.mk/?p=33129','Првоаприлското расположение доминира во СДСМ па нивните соопштенија на денот на шегата имаат каква-таква оправданост, кога со логиката веќе одамна се скараа\n\nСДСМ не е партијата која може да зборува за странски инвестиции. СДСМ може да раскажува само како се бркаат 200.000 луѓе на улица, како се затвараат 684 фабрики и како не се привлекуваат странски инвеститори','2016-04-01 19:21:01',11,168,3,182,'90137764259'),('10154173472859260','http://vmro-dpmne.org.mk/?p=33132','Најпоразуваниот политичар во историјата на Македонија Радмила Шекеринска и злосторничкото здружение СДСМ не може да обвинуваат никој друг за кризата во која само тие ја втурнаа земјата\n\nНајпрво СДСМ тоа го стори со непризнавањето на изборите за кои сите знаат дека беа кристално чисти, што се потврди и деновиве со последниот бродолом на лагите на СДСМ околу фантомските гласачи','2016-04-01 20:21:16',12,192,0,204,'90137764259'),('10154175292844260','http://vmro-dpmne.org.mk/?p=33135','Фирмите во Македонија плаќаат најниски даноци. Денес државата пет пати помалку зафаќа од заработката на компаниите во споредба со пред десет години. Тоа се стотици милиони евра годишно директна помош од Владата за домашните фирми преку даночната политика, вели вицепремиерот и министер за финансии Зоран Ставрески','2016-04-02 11:50:51',406,679,93,1178,'90137764259'),('10154175346344260','http://vmro-dpmne.org.mk/?p=33141','Продолжува непринципиелното неизбалансирано информирање на дел од медиумите кои отстапуваат илјадници секунди и објавуваат стотици написи секој ден во полза на лагите и манипулациите на СДСМ, додека истовремено ги извртуваат ставовите и неаргументирано го напаѓаат ВМРО-ДПМНЕ','2016-04-02 12:05:37',4,192,0,196,'90137764259'),('10154175350509260','http://vmro-dpmne.org.mk/?p=33138','Директорот на Агенцијата за вработување на Република Македонија, Влатко Поповски во интервју  говори за успешните мерки со кои им се помага на невработените лица, за историски најмалата стапка на невработеност и за отворените работни места. Тој ги советува невработените лица  да ги следат огласите за вработување објавени на официјалната страна бидејќи истите постојано се ажурираат и во моментов се активни 7000 отворени работни места','2016-04-02 12:31:00',471,631,95,1197,'90137764259'),('10154175533269260','http://vmro-dpmne.org.mk/?p=33147','Oчајот и паниката во СДСМ се видливи и од Месечината. Продолжуваат срамните притисоци на СДСМ кон судството\n\nПа така, во очајничка атмосфера, СДСМ ќе мисли дека граѓаните заборавиле која е партијата која во само еден ден смени и избра 617 судии и повеќе од сто обвинители\n\nСДСМ мисли дека граѓаните не знаат дека Наташа Габер Дамјановска е сестра на Виктор Габер несудениот министер за надворешни работи од СДСМ','2016-04-02 14:00:52',9,219,2,230,'90137764259'),('10154175727644260','http://vmro-dpmne.org.mk/?p=33150','Заменик министерот за труд и социјална политика Диме Спасов кој денес се обрати на трибината во организација на Институтот „Павел Шатев“ истакна дека оваа 2016 има многу новитети во смисла на мерки за вработување кои се реализираат преку Агенцијата за вработување и има многу тековни проекти кои можат да ги искористат граѓаните','2016-04-02 15:32:34',530,628,109,1267,'90137764259'),('10154175782629260','http://vmro-dpmne.org.mk/?p=33155','Криминалната банда на СДСМ веќе силно го чувствува поразот кој ќе им го нанесат граѓаните на изборите, па за таа цел веднаш ја активираа фабриката за лаги и  манипулации\n\nСоветниците на СДСМ од о. Аеродром кои во своето делување немаат мрднато со прст за граѓаните, денеска со проѕирни манипулации се обидуваат да соберат ситни и ефтини политички поени. Тие направија прес конференција на непостоечка тема. СДСМ имаа шанса да реализираат, проекти не го сторија тоа. Сега единствено плукаат и немаат доблест да поздрават ниту еден позитивен проект кој се реализира во Аеродром','2016-04-02 16:06:39',3,232,0,235,'90137764259'),('10154175898374260','http://vmro-dpmne.org.mk/?p=33159','Мерката за бесплатен автобуски превоз за студентите што Владата неодамна ја промовираше максимално се искористува и ја користат околу 16.000 студенти кои за тоа извадиле соодветна документација. Тие досега според пресметките заштедиле околу 250.000 евра или околу 16.300.000 денари месечно, оцени лидерот на ВМРО-ДПМНЕ Nikola Gruevski','2016-04-02 17:13:00',326,572,64,962,'90137764259'),('10154175987069260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154175977469260/?type=3','Промовирани 30 нови наслови од едицијата Врвови на светската филозофија, историја и психологија со психоанализа, сабота, 2 април 2016','2016-04-02 17:37:04',139,1553,17,1709,'90137764259'),('10154176217074260','http://vmro-dpmne.org.mk/?p=33162','Пајтон партијата НСДП и Горан Мисовски кои имаат рејтинг меѓу народот изразен во промили, веројатно нема да биде забележана од страна на јавноста кога ќе исчезне после изборите на 5 јуни','2016-04-02 19:15:31',4,208,0,212,'90137764259'),('10154176221174260','http://vmro-dpmne.org.mk/?p=33164','Извештајот на Стандард и пурс е еден многу добар извештај, во сложени политички услови на политичка криза и се чини дека за сега одличните економски политики ја победуваат политичката криза, иако таа сепак има мало влијание. Доколку не би била политчката криза, Македонија би имала уште подобар економски развој, рече денеска лидерот на ВМРО-ДПМНЕ, Nikola Gruevski','2016-04-02 19:27:00',5,194,1,200,'90137764259'),('10154176227184260','http://vmro-dpmne.org.mk/?p=33169','Вкупно 115 наслови од едицијата „Врвови на светската филозофија, историја и психологија со психоанализа“ се преведени до сега. А нови 15 беа промовирани денеска и истите имаат исклучително културно, научно и општествено значење за нашата средина и кој иницира една долгорочна мисија за развивање и подигање на нивото на општата интелектуална култура во државата, беа промовирани денеска во Археолошкиот музеј на Македонија','2016-04-02 19:53:00',5,145,0,150,'90137764259'),('10154176239034260','http://vmro-dpmne.org.mk/?p=33172','СДСМ во текот на своето владеење единствена мерка која ја има направено за економијата е мерката : ”Купи општествено претпријатие под реалната пазарна цена”, за која можеа да аплицираат единствено дотогашните директори на истите тие претпријатија, оставајки 200 000 работници на улица, со крајна цел максимизирање на профитот кој завршуваше во џебовите на истите тие новкомпонирани газди и партиските моќници од Бихаќка','2016-04-02 19:25:16',11,242,0,253,'90137764259'),('10154177894559260','http://vmro-dpmne.org.mk/?p=33176','Во Македонија во последните десет години се отворени 150.000 нови работни места. Сегашната влада создаде систем за решавање на најголемиот проблем кој произлезе од транзицијата – проблемот со невработеноста. И како што може да се види тој систем успешно функционира','2016-04-03 09:57:07',378,1445,97,1920,'90137764259'),('10154178155764260','http://vmro-dpmne.org.mk/?p=33179','Пред сигурнот пораз на изборите се зголемува тензијата, очајот и паниката во СДСМ па продолжуваат невидените срамни пресметки на СДСМ со Уставниот суд\n\nНа сила е и понатаму срамното сценарио на СДСМ за создавање алиби за бегство од избори, за нивно одложување или непризнавање на резултатите','2016-04-03 12:14:12',13,229,2,244,'90137764259'),('10154178161554260','http://vmro-dpmne.org.mk/?p=33182','Граѓаните кои ги следат медиумите блиски до СДСМ или финансирани од Сорос повторно немаа прилика да ги слушнат сите факти и да добијат вистинска слика за тоа што се случува во државата','2016-04-03 12:31:00',16,228,0,244,'90137764259'),('10154178448464260','http://vmro-dpmne.org.mk/?p=33186','Министерството за образование и наука во соработка со Светска банка преку “Проектот за развој на вештини и поддршка на иновации“, започнува со реализација на грант програма вредна 700.000 евра, чија цел е поврзувањето на јавните средни стручни училишта со малите, средните и големи компании во земјата, со краен очекуван исход – подобрување на практичната настава и вештините за вработување на учениците','2016-04-03 14:36:15',377,544,70,991,'90137764259'),('10154178573294260','http://vmro-dpmne.org.mk/?p=33190','Во Струмица денеска беше пуштена во употреба зградата на јавната администрација, во која ќе бидат сместени подрачните одделенија на Управата за имотно-правни работи на УЈП, Агенцијата за катастар на недвижности и Управата за матична евиденција','2016-04-03 15:24:10',375,574,59,1008,'90137764259'),('10154178714889260','http://vmro-dpmne.org.mk/?p=33193','Отворањето на капацитетите на Џонсон Контролс е одлична инвестиција за која долго време работевме да го убедиме инвеститорот да дојде токму во Струмица бидејќи во градот немаше поголем странски инвеститор кој би апсорбирал поголем број од невработената работна сила. Отворањето на нивниот објект е одлична можност многу од луѓето кои се невработени да си го решат својот проблем','2016-04-03 16:24:41',3,151,2,156,'90137764259'),('10154178916434260','http://vmro-dpmne.org.mk/?p=33197','Криминалната банда наречена СДСМ покажа дека нема ни срам ни перде. Безуспешни се сите обиди да го покријат нивното срамно шурување со криминалци, фалсификатори, уценувачи и рекетари.\n\nКрајно лицемерно и потценувачки за граѓаните е СДСМ да говори за безбедност на граѓаните, за борба со криминалот, достоинство на полицијата','2016-04-03 17:35:50',19,306,7,332,'90137764259'),('10154178925114260','http://vmro-dpmne.org.mk/?p=33199','Покрај на градовите ВМРО-ДПМНЕ исклучително внимание обрнува на руралните места. Сакаме луѓето да се задржат во руралните места, да живеат таму и да не бидат приморани да ги менуваат живеалиштата заради исклучително лоши услови. Проектот „Рурална аптека“ е дел од тоа. Тоа е дел од грижата на ВМРО-ДПМНЕ за луѓето, за граѓаните во селата и во малите населени места. Тие не смеат да бидат заборавени. Тие беа и ќе бидат поддржувани од ВМРО-ДПМНЕ и од коалицијата „ За подобра Македонија“','2016-04-03 18:00:01',10,158,3,171,'90137764259'),('10154179016144260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154179016144260/?type=3','Претседателот на ВМРО-ДПМНЕ Никола Груевски ја посети општина Струмица каде присуствуваше на отворањето на нова зграда за јавната администрација, изврши увид на обновената фасада на Државниот архив како и активностите при изградба на театарот во Струмица','2016-04-03 18:22:23',139,1553,17,1709,'90137764259'),('10154179026044260','http://vmro-dpmne.org.mk/?p=33203','До крајот на декември треба да биде готова изградбата на Стариот театар во Струмица. Ова го најави претсеателот на ВМРО ДПМНЕ Никола Груевски откако направи увид во досегашните градежни активности на објектот. Инвестицијата чини 4 милиони евра, а станува збор за нов објект кој се гради врз темелите на претходно опожарениот театар.','2016-04-03 19:15:00',8,142,0,150,'90137764259'),('10154179168719260','http://vmro-dpmne.org.mk/?p=33206','Амбулантата во Маџари е комплетно реконструирана. По 50 години откако е изградена доби целосно нов лик. Инвестицијата е на Здравствен дом, а со неа се подигнува квалитетот на здравствени услуги за пацинетите од овој регион.','2016-04-03 19:55:00',14,335,2,351,'90137764259'),('10154179438754260','http://vmro-dpmne.org.mk/?p=33210','Владата и министерството за култура планираат реновирање на поголем број фасади во старото градско јадро. Планот е да се опфатат пет во периодот кој е пред нас. Ќе се заштитат објекти кои имаат значење од естетски, од културен или од историски аспект','2016-04-03 21:15:01',6,121,0,127,'90137764259'),('10154179562704260','http://vmro-dpmne.org.mk/?p=33213','Во Музејот на Македонскиот народен театар вечерва е отворена новата поставка „Исчекори кон Сонцето“ која концепциски претставува сеќавање на првата театарска сезона 1945/46 година\nNikola Gruevski Елизабета Канческа Милевска','2016-04-03 21:44:48',10,103,0,113,'90137764259'),('10154180904819260','http://vmro-dpmne.org.mk/?p=33230','Економскиот раст во 2015 година и покрај политичката криза во Македонија, бил силен и дури и повисок од очекуваното. Високиот економски раст од 3,7 отсто од бруто домашниот производ, се должи ,пред се, на растот на извозот од слободните економски зони и јавните инвестиции, истакнува рејтинг агенцијата “Стандард и Пурс“ која повторно го потврди кредитниот рејтинг на Република Македонија ББ – со стабилен изглед','2016-04-04 10:48:29',436,572,81,1089,'90137764259'),('10154181059054260','http://vmro-dpmne.org.mk/?p=33235','Продолжува непринципиелното неизбалансирано информирање на дел од медиумите кои отстапуваат илјадници секунди и објавуваат стотици написи секој ден во полза на лагите и манипулациите на СДСМ, додека истовремено ги извртуваат ставовите на ВМРО-ДПМНЕ и неаргументирано го напаѓаат','2016-04-04 12:41:27',14,175,0,189,'90137764259'),('10154181060199260','http://vmro-dpmne.org.mk/?p=33238','Растат очајот и паниката во СДСМ пред поразот на престојните избори кој е се поблиску\n\nПреку срамните пресметки на СДСМ со Уставниот суд продолжува деструктивното сценарио за рушење на институциите и создавање алиби за бегство од избори, за нивно одложување или непризнавање на резултатите','2016-04-04 12:55:01',4,196,1,201,'90137764259'),('10154181220589260','http://vmro-dpmne.org.mk/?p=33241','Интегрален текст од прес конференција на Слободанка Алексовска, координатор на советничка група на ВМРО-ДПМНЕ во Град Скопје','2016-04-04 14:00:53',446,672,101,1219,'90137764259'),('10154181237514260','http://vmro-dpmne.org.mk/?p=33244','Секретарот за меѓународна соработка и член на Извршниот комитет на Унијата на млади сили на ВМРО-ДПМНЕ, Тимчо Муцунски, присуствуваше на Конгресот на Словенечка Демократска Младина (СДМ) кој се одржа во Љубљана помеѓу 1 и 3 Април','2016-04-04 14:18:54',4,158,0,162,'90137764259'),('10154181254604260','http://vmro-dpmne.org.mk/?p=33247','Политиките на Владата продолжуваат во насока за унапредување на правата на лица со инвалидност. Објавен е вториот по ред оглас за самовработување на лицата со инвалидност. Сите оние кои сакаат да основаат свој сопствен бизнис од денеска ќе можат да се пријават во подрачните единици на АВРМ и да добијат грант од државата од 270.000 денари. Дополнително, тие ќе можат да вработат уште најмногу две лица, за кои ќе добијат по 92 илјади денари','2016-04-04 14:44:01',20,169,1,190,'90137764259'),('10154181397184260','http://vmro-dpmne.org.mk/?p=33258','Kaкo што наближуваат изборите, така расте паниката меѓу криминалната банда од СДСМ, бидејќи тие се свесни дека на 6 јуни ќе дојде крајот на сите лаги и манипулации и дека ќе сносат одговорност за се што направија периодов\n\nВо прес конференцијата на Александар Кирацовски јасно се чита очајот и фрустрираноста на СДСМ од неуспехот на нивното сценарио. Ова не е ништо друго освен уште еден обид за креирање алиби за катастрофалниот пораз кој неминовно им претстои','2016-04-04 15:15:48',19,253,3,275,'90137764259'),('10154181867319260','http://vmro-dpmne.org.mk/?p=33273','Законот кој СДСМ го предложи денес во Собранието не постои во ниту една европска земја. Законот на СДСМ е хибрид преку кој што СДСМ сака преку своите и соросовите здруженија да воведе цензура во медиумите во Македонија.','2016-04-04 18:20:42',10,204,0,214,'90137764259'),('10154181887259260','http://vmro-dpmne.org.mk/?p=33264','Лидерот на ВМРО-ДПМНЕ Никола Груевски при денешната посета во Ресен, истакна дека процесот и натаму тече и дека државата води грижа за луѓето кои одгледуваат и имаат овошни насади, за луѓето што се занимаваат и живеат од овие култури и дека тоа ќе продолжи и во иднина.','2016-04-04 18:45:00',11,188,0,199,'90137764259'),('10154181906509260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154181906509260/?type=3','Отворање на Куќата на Татарчеви во Ресен, понеделник, 4 април 2016','2016-04-04 18:39:15',139,1553,17,1709,'90137764259'),('10154181945059260','http://vmro-dpmne.org.mk/?p=33276','Очигледно е дека една политичка партија како СДСМ која е очајна за власт, континуирано сака да прави штета на една од најпочитуваните институции, Армијата на Република Македонија и со тоа да го нарушува угледот кој Армијата го има кај сите граѓани на Република Македонија.','2016-04-04 19:10:00',9,212,0,221,'90137764259'),('10154181990614260','http://vmro-dpmne.org.mk/?p=33267','Петнаесет милиони евра Владата има инвестирано во Преспа во патната и комуналната инфраструктура и за подобрување на туристичката понуда. Лидерот на ВМРО-ДПМНЕ Никола Груевски денеска во Ресен истакна дека ова е регион во кој многу е инвестирано во рамките на можностите што ги има Владата.','2016-04-04 19:30:00',13,221,0,234,'90137764259'),('10154182060144260','http://vmro-dpmne.org.mk/?p=33279','Ова место во иднина ќе биде посетувано од многу луѓе кои ја познаваат историјата или кои што сакаат да се запознаат со историјата. Ова изборно ветување го ветивме пред граѓаните на Република Македонија бидејќи д-р Христо Татарчев беше значајна личност не само за Ресен, туку тоа е личност која има големо значење за сите граѓани, за целата држава и нација, истакна лидерот на ВМРО ДПМНЕ, истакна Груевски.','2016-04-04 19:59:41',10,135,2,147,'90137764259'),('10154183786679260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154183786679260/?type=3','Отчетно✔! Ова е разликата! Вака се сака Македонија!','2016-04-05 11:54:15',385,487,80,952,'90137764259'),('10154183789769260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154183789769260/?type=3','Отчетно✔! Ова е разликата! Вака се сака Македонија!','2016-04-06 12:06:00',11,120,1,132,'90137764259'),('10154183794019260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154183794019260/?type=3','Отчетно✔! Ова е разликата! Вака се сака Македонија!','2016-04-07 12:06:00',22,208,0,230,'90137764259'),('10154183885039260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154183885039260/?type=3','Отчетно✔! Ова е разликата! Вака се сака Македонија!','2016-04-08 12:33:00',9,120,0,129,'90137764259'),('10154183886009260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154183886009260/?type=3','Отчетно✔! Ова е разликата! Вака се сака Македонија!','2016-04-09 12:33:00',15,196,2,213,'90137764259'),('10154183886664260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154183886664260/?type=3','Отчетно✔! Ова е разликата! Вака се сака Македонија!','2016-04-10 12:33:00',46,165,13,224,'90137764259'),('10154183887139260','https://www.facebook.com/vmromakedonija/photos/a.23345955925