ne.org.mk/?p=33301','Извозот од индустриските зони бележи континуиран раст. Во првите три месеци извозот на странските компании од зоните изнесува 429 милиони евра и бележи раст од 33 проценти. Во третиот месец, односно март е забележан рекордниот извоз на овие компании од 165 милиони милиони евра, изјави денеска директорот на Дирекцијата за ТИРЗ Виктор Мизо','2016-04-05 15:18:55',24,199,0,223,'90137764259'),('10154184283104260','http://vmro-dpmne.org.mk/?p=33305','Интегрален текст од прес конференција на Елена Петковска, советник на ВМРО-ДПМНЕ во Општина Центар','2016-04-05 15:52:06',16,262,0,278,'90137764259'),('10154184294169260','http://vmro-dpmne.org.mk/?p=33297','Министерството за култура денеска ги промовираше последните девет книги од проектот „Превод на антологии на македонската книжевност на шест странски јазици“ – сублимиран приказ на репрезентативен избор од најдоброто од македонските литературни дела кои интегрално беа објавени во едицијата „135 тома македонска книжевност“, а потоа во целост преведени и на англиски јазик','2016-04-05 16:31:00',9,104,0,113,'90137764259'),('10154184302009260','http://vmro-dpmne.org.mk/?p=33309','Компаниите имаат уште 10 дена за искористување на поволностите кои ги нуди владиниот проект „Македонија вработува“, со кој работодавците се ослободуваат трајно или пак во одреден временски период од плаќање на социјални придонеси и персонален данок на доход за вработување на 5 категории на работници: млади до 35 години, лица на возраст од 35 до 50 години, лица над 50 години, лица над 58 години и лица од социјално ранливи категории','2016-04-05 16:12:01',21,182,0,203,'90137764259'),('10154184359494260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154184359494260/?type=3','Отчетно✔! Ова е разликата! Вака се сака Македонија!','2016-04-05 18:37:01',317,452,72,841,'90137764259'),('10154184361499260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154184361499260