83934260','http://vmro-dpmne.org.mk/?p=33312','Кире Наумов повторно се обидува да ја лаже и манипулира јавноста.\n\nТврдењата на Кире Наумов за трговската размена не држат вода, ако се земе предвид декa во 2015 година извозот е за 2 милијарди и 407 милиони евра поголем во однос на 2005 година или за цели 146,4%','2016-04-05 17:21:41',10,171,2,183,'90137764259'),('10154184484199260','http://vmro-dpmne.org.mk/?p=33316','Криминалот е единственото нешто што знаат да го сработат членовите на највисокото раководство на СДСМ. Секој криминалец мисли дека и другите крадат, односно дека и другите се криминалци, за што најдобар доказ е појавувањето на Александар Кирацовски, човекот осуден на три месеци условна затворска казна за учество во тепачка во кое едно лице било прободено со нож','2016-04-05 17:41:00',15,158,0,173,'90137764259'),('10154184621014260','http://vmro-dpmne.org.mk/?p=33319','Пендаровски се обиде да дојде на власт, но граѓаните му кажаа дека оној кој ги нарекува „стока“ никогаш нема да ја добие нивната доверба\n\nОдговорна власт е онаа која за 10 години отвора 150.000 нови работни места како владата на ВМРО-ДПМНЕ, наместо да брка 200.000 работници на улица како што направи СДСМ','2016-04-05 18:15:27',24,287,0,311,'90137764259'),('10154184645794260','http://vmro-dpmne.org.mk/?p=33322','Дали Саша Богдановиќ вчера го вработи Јон Фрчковски, синот на Љубомир Фрчковски во јавното претпријатие ПОЦ? Дали Јон фрчковски е истакнат член на СДСМ како актуелен претседател на СДММ Центар или позицијата ја заслужи неговиот татко со навредите и омаловажување на сопствениот народ во своите колумни?','2016-04-05 18:26:42',14,158,3,175,'90137764259'),('10154186567624260','http://vmro-dpmne.org.mk/?p=33325','Нема крај на непринципиелното неизбалансирано информирање на дел од медиумите кои отстапуваат илјадници секунди и објавуваат стотици написи секој ден во полза на лагите и манипулациите на СДСМ, додека истовремено ги извртуваат ставовите на ВМРО-ДПМНЕ и неаргументирано го напаѓаат','2016-04-06 12:48:27',127,220,25,372,'90137764259'),('10154186657504260','http://vmro-dpmne.org.mk/?p=33328','Како што се ближи сигурниот пораз на СДСМ на изборите, расте и паниката во нивните редови па продолжуваат со очајничките потези и срамното однесување\n\nСДСМ, партијата која во само еден ден смени и избра 617 судии и повеќе од сто обвинители, нема кредибилитет да зборува за партиските влијаниа врз правосудството','2016-04-06 13:38:46',136,218,22,376,'90137764259'),('10154186660269260','http://vmro-dpmne.org.mk/?p=33331','Започнува втората фаза од владината мерка грант за самовработување. Огласот е објавен денеска и сите невработени лица регистрирани во Агенцијата за вработување на Република Македонија кои имаат добра бизнис идеја ќе можат да аплицираат до 30 април годинава и да основаат свој сопствен бизнис. Со оваа мерка е предвиден грант од 200.000 денари неповратни средства од  државата за основање на 420 мали бизниси','2016-04-06 13:59:01',196,260,46,502,'90137764259'),('10154186831274260','http://vmro-dpmne.org.mk/?p=33334','Претседателот на ВМРО-ДПМНЕ, Nikola Gruevski, на својата фејсбук страница објави одлична вест за рударите од Пробиштип, Злетово, Крива Паланка и околните населени места, се потпиша договор за концесија за рудниците за олово и цинк „Злетово“ и „Тораница“. Компанијата Минстрој во најкус можен рок, што и беше примарна задача на Владата предводена од ВМРО-ДПМНЕ ќе ги рестартира рудниците и ќе обезбеди работа за рударите','2016-04-06 15:14:35',139,363,36,538,'90137764259'),('10154186944334260','http://vmro-dpmne.org.mk/?p=33343','Соопштение до јавноста –  изјава на Претседателот на ВМРО ДПМНЕ Никола Груевски во врска со невистинитите тврдења за недоставувањето на анкетен лист','2016-04-06 15:44:01',5,122,0,127,'90137764259'),('10154186955914260','http://vmro-dpmne.org.mk/?p=33345','Бугарски Минстрој, кој е водечка компанија во Источна Европа во областа на рударството, е новиот концесионер на рудниците за олово и цинк  „Тораница“ и „Злетово“. Со ова се решава еден од најзначајните проблеми на илјадници граѓани во Источна Македонија','2016-04-06 16:04:01',8,145,0,153,'90137764259'),('10154186974369260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154186974369260/?type=3','Потпишан договор за концесија на рудниците Злетово и Тораница, среда, 6 април 2016','2016-04-06 15:52:32',139,1553,17,1709,'90137764259'),('10154189310789260','http://vmro-dpmne.org.mk/?p=33349','Политиките за привлекување странски инвестиции даваат резултат. Во Македонија влегуваат компании кои вложуваат во запуштените капацитети, во загубарите, во рудниците со затворени окна, работниците се враќаат на работа. За разлика од порано кога фабриките се затвораа и работниците остануваа на улица, сега се случува обратен тренд, се отвораат нови капацитети и се рестартираат постојните.\n\n„Порцеланка“ станува од мртвите!','2016-04-07 12:34:50',367,442,82,891,'90137764259'),('10154189452589260','http://vmro-dpmne.org.mk/?p=33353','Медиумите кои според СДСМ се фер и избалансирани затоа што секојдневно на лагите од Бихаќка им отстапуваат илјадници секунди во своите информативни програми и дебатни емисии, повторно известуваа селективно\n\nГраѓаните кои ги следат овие медиуми уште еднаш ја немаа можноста да добијат вистинска слика за случувањата во земјата и да ја слушнат вистината. На пример, граѓаните не дознаа дека е објавен оглас со кој се предвидува грант од 200.000 денари неповратни средства од државата за основање на 420 мали бизниси','2016-04-07 14:02:44',230,422,29,681,'90137764259'),('10154189603689260','https://www.youtube.com/watch?v=SAJfT-Doqso','Следете во живо: Прес- конференција на лидерот на ВМРО-ДПМНЕ Никола Груевски во 15:15 https://www.youtube.com/watch?v=SAJfT-Doqso','2016-04-07 15:15:53',16,126,1,143,'90137764259'),('10154189803119260','http://vmro-dpmne.org.mk/?p=33367','Интегрален текст од прес конференција на Nikola Gruevski, Претседател на ВМРО-ДПМНЕ','2016-04-07 17:13:00',9,327,7,343,'90137764259'),('10154189811144260','http://vmro-dpmne.org.mk/?p=33361','Услови за избори има и избори ќе со одржат, а на нив може да се учествува или да не се учествува, истакна лидерот на ВМРО-ДПМНЕ Nikola Gruevski на денешната прес-конференција','2016-04-07 17:33:00',8,154,3,165,'90137764259'),('10154189832979260','http://vmro-dpmne.org.mk/?p=33363','Претседателот на ВМРО-ДПМНЕ Никола Груевски во денешното обраќање истакна дека услови за избори има и тие ќе се одржат и секој има право да одлучи дали ќе учествува на избори или нема да учествува затоа што и изборот на одлуки е слобода','2016-04-07 17:55:01',9,246,1,256,'90137764259'),('10154189836474260','http://vmro-dpmne.org.mk/?p=33365','Размислувајќи како да го започнам ова мое излагање, после вчерашниот ден и се што се случи, а за што сакам во детали да ве информирам, ми доаѓаат само два збора кои верувам на секого од вас му дошле на ум изминативе две години на криза, конфликтност, раздор, деструкции, во кои се обидуваме нешто да создадеме, да направиме мерки и реформи. А некој друг се обидува заради којзнае колкава цел да не разјаде, неретко споменувајќи ги зборовите слобода и демократија, а правејќи се што нема врска со слобода и демократија. Тие зборови се: „Доста беше“, рече лидерот на ВМРО-ДПМНЕ Nikola Gruevski во своето обраќање','2016-04-07 19:37:01',28,211,0,239,'90137764259'),('10154189999534260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154189999534260/?type=3','Свечен собир по повод 7 Април - Светски ден на здравјето во организација на Македонското лекарско друштво, четврток, 7 април 2016','2016-04-07 18:34:55',142,1638,16,1796,'90137764259'),('10154190007559260','http://vmro-dpmne.org.mk/?p=33377','Лидерот на ВМРО-ДПМНЕ, Никола Груевски денес порача дека е доста со кризи и дека Македонија повеќе не може да чека','2016-04-07 19:01:00',20,334,3,357,'90137764259'),('10154191607874260','http://vmro-dpmne.org.mk/?p=33381','','2016-04-08 11:04:31',8,155,1,164,'90137764259'),('10154191758834260','http://vmro-dpmne.org.mk/?p=33390','Со графичкиот регистар на градежно земјиште Македонија стана една од земјите каде што постапката за донесување на урбанистички планови се одвива целосно по електронски пат.','2016-04-08 12:36:13',16,76,0,92,'90137764259'),('10154192062709260','http://vmro-dpmne.org.mk/?p=33394','„Одбегнувањето на избори не е за спас на слободата и демократијата туку за спас на личните кариери на раководството на СДСМ, но притоа треба да се свесни дека државата не е алатка дадена во рацете на поединци и таа не може да зависи од одлуките на десетмина, стотина. Македонија не може да биде играчка на СДСМ. Иднината на оваа држава зависи од целиот народ“\n\nОва го истакна претседателот на ВМРО-ДПМНЕ Nikola Gruevski на денешниот семинар “Дигитална Европа: Младински Политики за Просперитет” кој е организиран од страна на Демократската Младинска Заедница на Европа и Унијата на Млади Сили на ВМРО-ДПМНЕ, а поддржан од Фондацијата Конрад Аденауер и Вилфред Мартенс Центарот за Европски Студии','2016-04-08 15:35:00',7,131,0,138,'90137764259'),('10154192075059260','http://vmro-dpmne.org.mk/?p=33397','Добро гледа народот кој што прави и кој за што зборува, истакна претседателот на ВМРО-ДПМНЕ Никола Груевски во обраќањето на семинарот “Дигитална Европа: Младински Политики за Просперитет” кој е организиран од страна на Демократската Младинска Заедница на Европа и Унијата на Млади Сили на ВМРО-ДПМНЕ','2016-04-08 16:15:01',3,57,0,60,'90137764259'),('10154192152889260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154192152889260/?type=3','Претседателот на ВМРО-ДПМНЕ Никола Груевски се обрати на семинарот „Дигитална Европа - Македонски политики за просперитет“, петок, 8 април 2016','2016-04-08 16:08:39',142,1638,16,1796,'90137764259'),('10154192161574260','http://vmro-dpmne.org.mk/?p=33401','„Македонија беше меѓу ретките земји во Европа која помина со полесни последици од светската економска и европската должничка криза, чии последици се чувствуваат и денес. За мала економија како нашата таквиот подвиг не ќе беше можен доколку тргнавме во дефанзива и чекавме кризниот бран во целост да не поклопи. Ние се втурнавме во кризата со полн налет на антикризни економски мерки и политики, како и бројни мерки за подобрување на бизнис климата и привлекување нови инвеститори“\n\nОва го истакна претседателот на ВМРО-ДПМНЕ Nikola Gruevski во денешното обраќање на семинар организиран од Демократската младинска заедница на Европа и Унијата на млади сили на ВМРО-ДПМНЕ на кој учествуваат подмладоци на партиите од десницата од повеќе земји од Европа','2016-04-08 16:45:01',1,27,0,28,'90137764259'),('10154192545739260','http://vmro-dpmne.org.mk/?p=33407','Агенцијата за катастар и недвижности со преку 30 големи, крупни проекти влезе во обемниот отчет кој го промовираше ВМРО-ДПМНЕ. Секој од нив во голема мера им е од помош на македонските граѓани','2016-04-08 19:19:35',12,213,0,225,'90137764259'),('10154194163729260','https://www.facebook.com/NGruevski/videos/10154060858617716/','','2016-04-09 11:32:20',0,69,0,69,'90137764259'),('10154194610459260','https://www.facebook.com/NGruevski/videos/10154060877682716/','','2016-04-09 14:57:14',0,72,0,72,'90137764259'),('10154194736309260','http://vmro-dpmne.org.mk/?p=33413','Продолжува непринципиелното и неизбалансирано информирање на дел од медиумите кои отстапуваат илјадници секунди и објавуваат стотици написи секој ден во полза на лагите и манипулациите на СДСМ, додека истовремено ги извртуваат ставовите и неаргументирано го напаѓаат ВМРО-ДПМНЕ','2016-04-09 15:59:56',8,213,2,223,'90137764259'),('10154194857814260','https://www.facebook.com/NGruevski/videos/10154060887987716/','','2016-04-09 17:14:05',0,42,0,42,'90137764259'),('10154195647974260','https://www.facebook.com/NGruevski/videos/10154060890762716/','','2016-04-09 23:15:41',0,28,1,29,'90137764259'),('10154197425424260','https://www.facebook.c