ва инвестициски бум. Постојано доаѓаат нови инвеститори, вложуваат капитал и вработуваат граѓани. Успехот е огромен и одамна видлив','2016-04-11 10:47:01',192,388,33,613,'90137764259'),('10154199501714260','http://dnevnik.mk/?ItemID=A55E8B7E23CF524FB2D2AF44F7978F33','Истиот четврток, од националната ТВ 21 портпаролот на ЛДП ни порача дека: „Македонија е концентрационен логор“. Што да каже човек на ова? Фин, артикулиран човек, во одело, на национална телевизија, со Ајфон или Нокиа или Самсунг, во 2016 година ни порачува дека себеси се доживува како Ана Франк или Ели Визел\nhttp://dnevnik.mk/?ItemID=A55E8B7E23CF524FB2D2AF44F7978F33','2016-04-11 12:09:52',6,132,4,142,'90137764259'),('10154199734469260','https://www.facebook.com/NGruevski/videos/10154067830047716/','','2016-04-11 14:26:13',0,16,0,16,'90137764259'),('10154199796749260','http://vmro-dpmne.org.mk/?p=33426','Медиумите кои според СДСМ се фер и избалансирани затоа што секојдневно на тезите произлезени од фабриките за афери на Бихаќка им отстапуваат илјадници секунди во своите информативни програми и дебатни емисии, повторно известуваа селективно','2016-04-11 14:55:22',11,157,0,168,'90137764259'),('10154199812709260','http://vmro-dpmne.org.mk/?p=33423','Нов пункт на Итна медицинска помош (ИМП) е отворен во општина Чучер Сандево, која опфаќа 14 населени места со 20.000 жители\n\nСтанува збор за осми по ред пункт на ИМП на подрачјето на Скопје. Пунтот е лоциран во амбулантата Сандево, ќе работи 24 часа, ќе има по еден тим и едно возило\n\nЛидерот на ВМРО-ДПМНЕ, Никола Груевски, за време на посетата на ова населено место во февруари годинава даде збор дека барањето на жителите ќе биде разгледано. За помалку од месец ипол, ова ветување беше исполнето','2016-04-11 15:15:01',7,133,0,140,'90137764259'),('10154199867009260','http://vmro-dpmne.org.mk/?p=33430','Продолжува огромната заложба за помош и поддршка за земјоделците. Лидерот на ВМРО-ДПМНЕ, Nikola Gruevski, денес  потенцира дека развојот на земјоделието е една од стратешките приоритети за владејачката партија.\n\nГруевски истакна дека преку напорен труд, дијалог и контакти со земјоделците, како и реализација на голем број мерки се создадоа услови за егзистенција на многу земјоделски семејства. Но, сепак овие заложби продолжуваат.\n\nПредвидена е можност за 80 проценти поддршка од државата за системи капка по капка и ископ на нови бунари. Воспоставување на систем за наводнување и соодветно дозирање на водата овозможува зголемување на приносите кај неколку култури и неколку пати.','2016-04-11 15:29:28',247,525,54,826,'90137764259'),('10154199883829260','http://vmro-dpmne.org.mk/?p=33438','Интегрален текст од прес конференција на Спиро Ристовски','2016-04-11 16:00:00',10,246,2,258,'90137764259'),('10154199885419260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154199885419260/?type=3','Промоција на нов проект во земјоделството, понеделник, 11 април 2016','2016-04-11 15:42:36',173,1838,22,2033,'90137764259'),('10154199940754260','http://vmro-dpmne.org.mk/?p=33442','Тодоров: Во делот на кофинансирана специјализација по гинекологија, е избран еден кандидат за Ново Село, со што ќе овозможиме за првпат оваа општина да добие матичен гинеколог. Исто така, по еден кандидат од областа на гинекологија е избран и за општините Струмица и Велес, и тројца кандидати за Скопје. За кофинансирана специјализација по педијатрија е избран еден доктор во општина Гостивар','2016-04-11 16:25:00',8,162,0,170,'90137764259'),('10154200338839260','http://vmro-dpmne.org.mk/?p=33445','Развојот на земјоделието е еден од нашите стратешки приоритети. Тоа е област каде затекнавме една од најхаотичните состојби во државата во 2006 година која беше резултат на повеќегодишна стагнација и запоставеност на земјоделието и земјоделците. Преку напорен труд, континуиран дијалог со здруженијата и контакти со земјоделците, реализација на постојани мерки и овозможување на поддршка успеавме да создадеме услови за достоинствена егзистенција на многу земјоделски семејства.','2016-04-11 19:30:00',239,442,57,738,'90137764259'),('10154200360769260','https://www.facebook.com/vmromakedonija/videos/10154200360769260/','Спиро Ристовски: Обидите да се спречат останатите граѓани да гласаат е криминал','2016-04-11 20:00:00',20,201,0,221,'90137764259'),('10154201930304260','http://vmro-dpmne.org.mk/?p=33457','Претседателот на ВМРО-ДПМНЕ, Nikola Gruevski, на својата фејсбук страница објави дека се исполнува уште едно големо ветување кое што го даде при неодамнешната посета на општина Кичево','2016-04-12 11:01:36',10,51,3,64,'90137764259'),('10154202224499260','http://vmro-dpmne.org.mk/?p=33471','Очајот на СДСМ како се ближат изборите станува се поочигледен\n\nСДСМ ниту има понуда, ниту има програма, ниту пак конкретни мерки и проекти во интерес на граѓаните. Затоа единствениот излез од партијата го гледаат во одработувањето на невладините организации','2016-04-12 14:03:35',15,272,2,289,'90137764259'),('10154202231614260','http://vmro-dpmne.org.mk/?p=33468','Од први септември, 131 дефектолог ќе биде ангажиран во основните и средните училишта низ цела Македонија со цел јакнење на стручните служби','2016-04-12 14:25:00',25,243,5,273,'90137764259'),('10154202309004260','http://vmro-dpmne.org.mk/?p=33474','Продолжува непринципиелното и неизбалансирано информирање на дел од медиумите кои отстапуваат илјадници секунди и објавуваат стотици написи секој ден во полза на лагите и манипулациите на СДСМ, додека истовремено ги извртуваат ставовите и неаргументирано го напаѓаат ВМРО-ДПМНЕ','2016-04-12 14:44:42',15,228,0,243,'90137764259'),('10154202334989260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154202334989260/?type=3','Лидерска средба на партиите од коалицијата „За подобра Македонија“, вторник, 12 април 2016','2016-04-12 14:58:51',186,1934,25,2145,'90137764259'),('10154202402769260','http://vmro-dpmne.org.mk/?p=33483','Изборите ќе се одржат на 5 јуни, како што е предвидено со распуштањето на Собранието и вметнато во Уставот и законите','2016-04-12 15:35:05',422,548,77,1047,'90137764259'),('10154202413044260','http://vmro-dpmne.org.mk/?p=33496','Компаниите имаат можност уште три дена да аплицираат за проектот „Македонија вработува“. Мега-проектот на Владата трае до крајот на неделава, односно до петок. Досега преку оваа мерка се реализирани речиси 17.500 вработувања','2016-04-12 15:55:00',8,179,2,189,'90137764259'),('10154202414169260','http://vmro-dpmne.org.mk/?p=33477','Во однос на состојбите по понудената оставка на министерот за внатрешни работи Оливер Спасовски и состојбите во работата на Министерството по вчерашното укинување на неговите одлуки од страна на Владата, заменик министерот Митко Чавков денеска оцени дека Министерството во сите области функционира вообичаено','2016-04-12 16:15:01',14,254,2,270,'90137764259'),('10154202418589260','http://vmro-dpmne.org.mk/?p=33491','Осумдесет илјади барања за легализација на нелегално изградени објекти се доставени во продолжениот рок за таа намена, кој истече на крајот на минатиот месец','2016-04-12 16:35:00',17,218,1,236,'90137764259'),('10154202419809260','http://vmro-dpmne.org.mk/?p=33489','Проектот кој што вчера го промовираше лидерот на ВМРО-ДПМНЕ Никола Груевски за 80 процентна поддршка за земјоделците кои ќе инсталираат капка по капка преставува огромна можност за земјоделците кои на тој начин ќе го зголемат производството и ќе имаат поголем квалитет. Огромни се предностите и можностите кои ги нуди проектот','2016-04-12 17:00:00',14,238,3,255,'90137764259'),('10154202706664260','http://vmro-dpmne.org.mk/?p=33500','ВМРО ДПМНЕ не се сомнева дека Претседателот Иванов секогаш имал чесни и добри намери и постапки, водејќи се од националните и државни интереси и идејата за национално помирување и единство, кое сметаме дека е секогаш потребно. Сепак во конкретниов случај би сакале да изразиме силно несогласување со оваа негова постапка.','2016-04-12 18:21:16',34,267,14,315,'90137764259'),('10154204648724260','http://vmro-dpmne.org.mk/?p=33505','Медиумите кои според СДСМ се фер и избалансирани затоа што секојдневно на тезите произлезени од фабриките за афери на Бихаќка им отстапуваат илјадници секунди во своите информативни програми и дебатни емисии, повторно известуваа селективно.\n\nГраѓаните кои ги следат овие медиуми уште еднаш ја немаа можноста да добијат вистинска слика за случувањата во земјата и да ја слушнат вистината.','2016-04-13 13:11:59',4,38,0,42,'90137764259'),('10154205795439260','http://vmro-dpmne.org.mk/?p=33509','Тоа што криминалецот Зоран Заев го најави на Телма во режираното интервју, дивите орди на СДСМ и на Сорос почнаа вечерва да го реализираат по улиците на Скопје.\n\nБез грам совест и грижа за иднината на земјата, злосторникот Зоран Заев јасно кажа дека во Македонија се поставени сериозни темели за украинско сценарио. Истото сценарио кое во меѓусебната комуникација го најавуваа Верушевски и другите креатори.\n\nИсход на сценариото во Украина, досега се десетици илјади мртви и поделена држава. Поделба на Македонија, која што вчера ја побараа партнерите на Зоран Заев од Беса.','2016-04-13 22:28:48',38,309,11,358,'90137764259'),('10154207037874260','https://www.youtube.com/watch?v=nrD-m9nw2u8&feature=youtu.be','','2016-04-14 13:17:00',0,87,2,89,'90137764259'),('10154207297019260','http://vmro-dpmne.org.mk/?p=33513','Пред два дена ВМРО-ДПМНЕ беше прва партија која јавно реагираше на прес конференцијата на претседателот Иванов во која го искажав својот став\n\nИнтересот на СДСМ е во земјава да има анархија, да има безредие и хаос, но тоа не е интерес на македонските граѓани и на ВМРО-ДПМНЕ. Нашиот заеднички интерес е земјата да оди напред, демократијата да функционира, одлуките на слободни и фер избори да ги носат граѓаните на Република Македонија, рече Nikola Gruevski','2016-04-14 15:36:16',7,222,1,230,'90137764259'),('10154207320549260','https://www.facebook.com/NGruevski/videos/10154075491782716/','','2016-04-14 15:52:03',0,286,7,293,'90137764259'),('10154207366664260','http://vmro-dpmne.org.mk/?p=33515','„Зоран Заев има една и единствена цел да дојде на власт без поддршка на мнозинството граѓани на Македонија. Додека стојам нема да ти го дозволам тоа, ни јас ни народот. И самиот си свесен дека народот сака да заврши кризата, престани да ги организираш хулиганите да го реметат мирот на гражѓаните. Собери еднаш храброст и излези да се соочиш со народот на избори, на фер и демократски избори. Доста бараш изговори“ Ова му го порача претседателот на ВМРО-ДПМНЕ Никола Груевски на лидерот на опозицијата Зоран Заев на денешната прес-конференција.','2016-04-14 16:19:01',14,322,3,339,'90137764259'),('10154207368094260','http://vmro-dpmne.org.mk/?p=33517','Интегрален текст од прес конференција на на Никола Груевски, Претседател на ВМРО-ДПМНЕ','2016-04-14 16:44:00',161,724,39,924,'90137764259'),('10154207372574260','http://vmro-dpmne.org.mk/?p=33519','Интересот на СДСМ е во земјата да има анархија, безредие и хаос. Но, тоа не е интерес на граѓаните и на ВМРО-ДПМНЕ. Наш заеднички интерес е земјата да оди напред, демократијата да функционира, одлуките  на слободни и фер избори да ги ностат граѓаните, рече лидерот на ВМРО-ДПМНЕ Никола Груевски во своето обраќање','2016-04-14 17:15:00',137,357,31,525,'90137764259'),('10154207381534260','http://vmro-dpmne.org.mk/?p=33531','“Сакам да му се обратам: додека стојам нема да ти го дозволам тоа. Ни јас, ни народот! И самиот си свесен дека народот сака да заврши кризата. Престани да ги организираш хулиганите да го реметат мирот на граѓаните. Собери еднаш храброст и излези да се соочиш  со народот на избори. Доста бараш изговори“, заклучи Груевски','2016-04-14 18:00:01',38,472,9,519,'90137764259'),('10154207511884260','https://www.facebook.com/vmromakedonija/photos/a.233459559259.136702.90137764259/10154207511884260/?type=3','','2016-04-14 17:26:11',334,1207,48,1589,'90137764259'),('10154207615454260','http://vmro-dpmne.org.mk/?p=33536','Ги повикувам СДСМ наместо да продолжат да бараат алиби за неизлегување на изборите, да излезат на избори. Ако аргументите кои ги говорат, се реални, народот сигурно ќе им го вреднува тоа. Не треба да се плашат од народот. Ги повикувам СДСМ на избори и на фер и демократски начин да му се даде на народот шанса да се определи кој понатаму да биде власт а кој опозиција','2016-04-14 18:32:00',182,437,45,664,'90137764259'),('10154207616464260','http://vmro-dpmne.org.mk/?p=33525','Жалиме што оваа одлука значи ослободување од гонење на Зоран Заев и Зоран Верушевски, како и неколкумина други нивни соработници. Овие двајца луѓе, ставајки се во туѓ интерес, и нанесоа огромна штета на државата и народот, и тие требаше да одговараат','2016-04-14 19:05:35',12,209,4,225,'90137764259'),('10154207769989260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154207769989260/?type=3','Прес на лидерот на ВМРО-ДПМНЕ Никола Груевски, четврток, 14 април 2016','2016-04-14 19:51:25',202,2202,35,2439,'90137764259'),('10154209070544260','http://vmro-dpmne.org.mk/?p=33554http%3A%2F%2Fvmro-dpmne.org.mk%2F%3Fp%3D33554','Одлуката на Претседателот Ѓорге Иванов не е во согласност со заложбите на ВМРО-ДПМНЕ. Нашиот став е јасен, секој што направил криминал треба да одговара\n\nОд тие причини, ВМРО-ДПМНЕ денеска ќе предложи да биде испратено писмо до Претседателот Иванов, потпишано од четирите најголеми политички партии, со барање да биде преиспитана одлуката за прекинување на кривичните постапки\n\nВо текот на денот ВМРО-ДПМНЕ ќе стапи во контакт со останатите три партии при што ќе им го понудиме нашиот предлог','2016-04-15 09:51:58',81,167,16,264,'90137764259'),('10154209255424260','http://vmro-dpmne.org.mk/?p=33557','Проектот “Македонија вработува-се бориме за секое работно место” беше најавен од страна на претседателот на ВМРО-ДПМНЕ Никола Груевски во март 2015 на митингот во Битола','2016-04-15 12:34:10',235,463,62,760,'90137764259'),('10154209300334260','http://vmro-dpmne.org.mk/?p=33560','Прометот во индустријата во февруари  годинава, во однос на февруари лани, бележи раст од 14,9 отсто, објави Државниот завод за статистика','2016-04-15 13:02:56',256,400,66,722,'90137764259'),('10154209435049260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154209435049260/?type=3','Активности за месец април 2016 година www.vmro-dpmne.org.mk','2016-04-15 14:22:14',208,2298,35,2541,'90137764259'),('10154209598954260','http://vmro-dpmne.org.mk/?p=33566','Продолжува непринципиелното и неизбалансирано информирање на дел од медиумите кои отстапуваат илјадници секунди и објавуваат стотици написи секој ден во полза на лагите и манипулациите на СДСМ, додека истовремено ги извртуваат ставовите и неаргументирано го напаѓаат ВМРО-ДПМНЕ','2016-04-15 15:33:00',7,221,0,228,'90137764259'),('10154209624839260','http://vmro-dpmne.org.mk/?p=33569','','2016-04-15 15:46:27',17,225,8,250,'90137764259'),('10154210286509260','http://vmro-dpmne.org.mk/?p=33580','Лидерот на ВМРО-ДПМНЕ Никола Груевски веднаш по прес конференцијата на претседателот Ѓорге Иванов поднесе барање до него за поништување на одлуките за прекин на кривичните постапки.','2016-04-15 21:52:19',206,318,53,577,'90137764259'),('10154211608259260','http://vmro-dpmne.org.mk/?p=33582','ВМРО-ДПМНЕ ги осудува сите обиди да се повредуваат индивидуалните права, дури и кога тоа се прави под превезот на наводен револт на студентите','2016-04-16 13:43:31',9,90,1,100,'90137764259'),('10154211727319260','http://vmro-dpmne.org.mk/?p=33587','Медиумите кои според СДСМ се фер и избалансирани затоа што секојдневно на тезите произлезени од фабриките за афери на Бихаќка им отстапуваат илјадници секунди во своите информативни програми и дебатни емисии, повторно известуваа селективно. Граѓаните кои ги следат овие медиуми уште еднаш ја немаа можноста да добијат вистинска слика за случувањата во земјата и да ја слушнат вистината.','2016-04-16 14:44:23',1,27,0,28,'90137764259'),('10154212169759260','https://www.facebook.com/NGruevski/posts/10154080357332716','','2016-04-16 18:29:24',0,100,0,100,'90137764259'),('10154212231044260','http://vmro-dpmne.org.mk/?p=33590','Заев тргнува од неговите лични интереси, а не државните интереси. Затоа губи на избори и затоа ќе губи и на 5-ти јуни ќе биде тешко поразен ако се појави на изборите, рече Груевски при гостувањето во Дневникот на Канал 5 телевизија','2016-04-16 19:09:01',12,270,5,287,'90137764259'),('10154212255164260','http://vmro-dpmne.org.mk/?p=33594','„Одлична вест е што прво претседателот на Парламентот Трајко Вељаноски ги распиша изборите на 5 јуни и на тој начин земјата оди напред, се наближува почетокот на крајот на оваа агонија која ни ја направи СДСМ во овој период. Одлична вест е и што Државната изборна комисија најде сили да го каже тоа што е вистина, тоа што сите го очекувавме- дека услови за фер, слободни и демократски избори постојат“\n\nОва го истакна претседателот на ВМРО-ДПМНЕ Никола Груевски, кој денеска гостуваше во Дневникот на ТВ Канал 5','2016-04-16 19:35:00',15,369,4,388,'90137764259'),('10154212261324260','http://vmro-dpmne.org.mk/?p=33597','Имаме еден нов проект, кој еве сега за првпат ќе го споменам, се работи за проект со кој што сакаме да им помогнеме на земјоделците да добијат советници, земјоделски советници е насловот на проектот, рече лидерот на ВМРО-ДПМНЕ Никола Груевски во своето гостување во Дневникот на Канал 5','2016-04-16 20:15:00',15,219,5,239,'90137764259'),('10154212271209260','http://vmro-dpmne.org.mk/?p=33601','Државната изборна комисија се изјасни, кажа дека постојат услови за фер, слободни и демократски избори организирани на 5 јуни оваа година, истакна претсеадателот на ВМРО-ДПМНЕ Nikola Gruevski, во денешното гостување во Дневникот на Канал 5','2016-04-16 20:45:00',10,270,4,284,'90137764259'),('10154212998624260','http://vmro-dpmne.org.mk/?p=33610','Многу е тешко вака да се функционира. Знам како беше и пред околу една година во овој период кога секојдневно Заев излегуваше со фабрикуваните, креираните материјали, многу е тешко и сега. Тешко е со инвеститорите, тешко е да се задржат. Макотрпно се боревме да ги обезбедиме, макотрпно се бориме да ги убедуваме да дојдат во Македонија за да ни отворат нови работни места','2016-04-17 07:00:00',1,153,2,156,'90137764259'),('10154212999274260','http://vmro-dpmne.org.mk/?p=33613','Следејќи ги тезите на претседателот тој навистина има патриотски мотиви, сака да помогне за доброто на државата, вели во интервју за Канал5 телевизија претседателон на ВМРО-ДПМНЕ, Nikola Gruevski','2016-04-17 08:00:00',3,161,1,165,'90137764259'),('10154212999939260','http://vmro-dpmne.org.mk/?p=33616','Навистина правиме се, економскиот тим на Владата каде што ВМРО-ДПМНЕ има најголем дел од министрите, прави максимум да ги задржи инвеститорите со кои што до сега преговаравме, еве последно што објавивме е со позната германска компанија која што се вика „СТС Текстаил“ за Демир Хисар да отворат фабрика, луѓето кажаа дека за почеток ќе отворат 150 луѓе, а дека ќе дојдат до бројка од 1000 луѓе, истакна претседателот на ВМРО-ДПМНЕ, Никола Груевски во гостувањето во Дневникот на Канал 5','2016-04-17 09:00:00',4,130,1,135,'90137764259'),('10154213000449260','http://vmro-dpmne.org.mk/?p=33618','Со ова СДСМ практично и Заев оди против своето членство, затоа што тие се тие што ќе останат без ниту еден пратеник во Парламентот на Република Македонија. Она што можам да го видам е дека практично во сиот овој период, гледам дека самиот Заев нема капацитет да признае пораз, рече Груевски во Дневникот на Канал 5','2016-04-17 10:00:01',4,139,3,146,'90137764259'),('10154213000749260','http://vmro-dpmne.org.mk/?p=33620','Претседателот на ВМРО-ДПМНЕ Никола Груевски, кој денеска беше гостин во Дневникот на Канал 5, истакна дека лидерот на опозицијата Зоран Заев сака да креира криза во државата поради своја лична корист и токму поради тоа ќе биде поразен','2016-04-17 11:00:00',6,121,2,129,'90137764259'),('10154213001264260','http://vmro-dpmne.org.mk/?p=33622','Изборите за оваа година се закажани уште пред една година, откако СДСМ започна со објавување на креираните материјали за кои што Зоран Заев ми кажа дека му ги дале странски разузнавачки служби. Откако го направи сето тоа што го направи во државата, откако  ја дестабилизира државата тој побара избори, ние се согласивме и во разговор со него и со претставниците олеснувачи од меѓународната заедница, заеднички се договоривме тоа да биде 24 април оваа година, рече Груевски','2016-04-17 11:59:00',4,91,2,97,'90137764259'),('10154213923109260','http://vmro-dpmne.org.mk/?p=33624','СДСМ конечно призна дека демолирањето, физичките напади, палењето и уништувањето на спомен обележјата се прави со единствена цел криминалецот Зоран Заев да избега од соочување со граѓаните на изборите на 5-ти јуни.','2016-04-17 13:51:08',312,664,58,1034,'90137764259'),('10154214048714260','http://vmro-dpmne.org.mk/?p=33632','Министерството за здравство ќе кофинансира 20 до 80 проценти од нивната специјализација и потоа ќе имаат загарантиран месечен надомест. Особено ќе внимаваме на првата дипломирана генерација на студенти од Штипскиот универзитет, имајќи предвид дека овие веќе завршени доктори се од внатрешноста на Македонија од повеќе различни градови каде што имаме недостаток на специјалисти, се со цел да се надмине проблемот со недостаток на специјалисти во повеќе градови во земјата','2016-04-17 14:53:22',4,127,2,133,'90137764259'),('10154214084944260','http://vmro-dpmne.org.mk/?p=33627','Продолжува непринципиелното и неизбалансирано информирање на дел од медиумите кои отстапуваат илјадници секунди и објавуваат стотици написи секој ден во полза на лагите и манипулациите на СДСМ, додека истовремено ги извртуваат ставовите и неаргументирано го напаѓаат ВМРО-ДПМНЕ.','2016-04-17 15:13:33',308,452,48,808,'90137764259'),('10154214130004260','http://vmro-dpmne.org.mk/?p=33628','„Аболицијата дадена од претседателот Црвенковски нема да ја коментирам во јавноста. Tоа е негово уставно и законско право“ рече помилуваниот криминалец Зоран Заев со солзи радосници во 2008 година кога благодарение на Црвенковски си ја спаси кожата.','2016-04-17 15:37:21',42,287,5,334,'90137764259'),('10154216089714260','http://vmro-dpmne.org.mk/?p=33643',',,Потребно е да имаме сеопфатна стратегија во која ќе биде вклучено создавање подобри услови за мигрантите во земјите кои се непосредни соседи на Сирија и Ирак, односно Турција, Либан и Јордан\". Изјави министерот за одбрана Зоран Јолевски во интервју за Гласот на Америка, по Конференцијата во Вашингтон, САД, посветена на мигрантската криза.','2016-04-18 11:52:42',7,145,1,153,'90137764259'),('10154216107769260','http://vmro-dpmne.org.mk/?p=33637','ПОВИК\n\nЗа кандидирање на кандидати за Претседател на Унијата на ветерани на ВМРО-ДПМНЕ','2016-04-18 12:06:07',26,262,0,288,'90137764259'),('10154216275099260','http://vmro-dpmne.org.mk/?p=33648','Проектот кој во саботата го најави лидерот на ВМРО-ДПМНЕ Nikola Gruevski за ангажирање земјоделски советници ќе има повеќекратен бенефит, сметаат земјоделците. Според нив, овој чекор води кон осовременување на земјоделството во Македонија, што најверојатно ќе придонесе за поголемо и поквалитетно производство, и само така ние може да бидеме поконкурентни на пазарот','2016-04-18 13:35:34',429,798,137,1364,'90137764259'),('10154216561699260','http://vmro-dpmne.org.mk/?p=33654','Здравствената станица Железара е комплетно реновирана, инфрастуктурно е подобрена со реконструкција на сите тоалети, ходници, шалтери и ординации, изјави при денешната посета министерот за здравство Никола Тодоров.','2016-04-18 15:40:32',13,166,2,181,'90137764259'),('10154216768279260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154216768279260/?type=3','Министерот Никола Тодоров во посета на Здравствената станица Железара, понеделник, 18 април 2016','2016-04-18 17:24:22',284,2999,47,3330,'90137764259'),('10154218944864260','http://vmro-dpmne.org.mk/?p=33660','Главни бизнис активности што ќе се нудат во Агро бизнис зоната ќе бидат калибрирање, пакување и разладување, определување на цената на берза, утовар и дистрибуција и се разбира, купопродажба. Македонија ќе добие интегриран систем на земјоделското производство, што ќе го намали бројот на учесници во синџирот на набавки, а со самото тоа ќе овозможи и поволна цена за земјоделските производи, но и механизам за воспоставување на фер цена и амортизација на ценовните шокови во период на пазарни вишоци','2016-04-19 16:10:01',160,490,52,702,'90137764259'),('10154218960209260','http://vmro-dpmne.org.mk/?p=33657','Продолжува непринципиелното и неизбалансирано информирање на дел од медиумите кои отстапуваат илјадници секунди и објавуваат стотици написи секој ден во полза на лагите и манипулациите на СДСМ, додека истовремено ги извртуваат ставовите и неаргументирано го напаѓаат ВМРО-ДПМНЕ','2016-04-19 15:52:25',241,658,51,950,'90137764259'),('10154219001209260','http://vmro-dpmne.org.mk/?p=33663','Единаесет доктори ќе заминат на специјализација во Белград и во Загреб, каде што ќе ги усовршуваат знаењата и искуствата во седум различни медицински области – дигестивна хирургија, офталмологија, гинекологија и акушерство, анестизиологија, трауматологија, интерна медицина и општа хирургија.','2016-04-19 17:00:00',208,569,61,838,'90137764259'),('10154219190319260','http://vmro-dpmne.org.mk/?p=33667','Интегрален текст од обраќањето на Nikola Gruevski, Претседател на ВМРО-ДПМНЕ','2016-04-19 18:07:41',256,604,59,919,'90137764259'),('10154219374919260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154219141869260/?type=3','Претседателот на ВМРО-ДПМНЕ Никола Груевски промовираше нов проект од областа на земјоделието, вторник, 19 април 2016','2016-04-19 19:30:55',284,2999,47,3330,'90137764259'),('10154219440944260','http://vmro-dpmne.org.mk/?p=33670','За членот на Извршниот комитет на ВМРО-ДПМНЕ Никола Тодоров, одлуката на Државната изборна комисија дека има услови за предвремени избори била очекувана','2016-04-19 20:11:09',188,781,48,1017,'90137764259'),('10154219477779260','http://vmro-dpmne.org.mk/?p=33673','Протестот е демократско право, вандализмот не. Да изразиш револт е дел од демократијата, но вандализмот никако, истакна Никола Тодоров, член на ИК на ВМРО-ДПМНЕ кој беше гостин во Дневникот на Канал 5','2016-04-19 20:35:11',196,792,47,1035,'90137764259'),('10154219547484260','http://vmro-dpmne.org.mk/?p=33675','Начинот на кој што СДСМ функционира во Владата е истиот начин на кој што СДСМ функционира на улица. Тоа е анархија. Тоа е безредие, безвластие, непочитување на закон, непочитување на правила, непочитување на сопствената држава, на сопствениот народ и сопствените институции и историја, вели членот на ИК на ВМРО-ДПМНЕ Никола Тодоров за Дневникот на Канал 5','2016-04-19 21:01:58',182,574,37,793,'90137764259'),('10154219591359260','http://vmro-dpmne.org.mk/?p=33677','Исполнети се сите услови кои СДСМ ги бараше пред 2 години, да имаме нова Државна изборна комисија каде што владејачкото мнозинство се откажа од сопственото множество во ДИК, да имаме Влада каде претседателот на владејачката партија нема да биде на премиерската позиција, и тоа го имаме повеќе денови од што беше предвидено. Да имаат министри, заменици, дополнителни заменици министри, и тоа го имаат. Единствено што немаат е поддршка од народот, истакна Antonio Miloshoski, член на ИК на ВМРО-ДПМНЕ','2016-04-19 21:22:29',241,1171,62,1474,'90137764259'),('10154219643399260','http://vmro-dpmne.org.mk/?p=33680','Нема да биде изненадување за нас доколку делегацијата на СДСМ ако потврдат присуство за состанокот во Виена побара повторно одложување на изборите. Но, сметаме дека одложувањето на изборите е само одложување на кризата, истакна Antonio Miloshoski, член на ИК на ВМРО-ДПМНЕ','2016-04-19 21:46:03',292,919,75,1286,'90137764259'),('10154219678084260','http://vmro-dpmne.org.mk/?p=33686','Очекувањата 