политичка непрофесионална и пристрасна институција','2016-04-23 14:41:16',494,1094,100,1688,'90137764259'),('10154228302049260','http://vmro-dpmne.org.mk/?p=33791','СЈО со секоја своја нова прес конференција покажува дека работи повеќе како политичко а помалку како обвинителско тело и со тоа се повеќе ги руши очекувањата на јавноста и довербата која му беше дадена преку партиите со договорот од Пржино со кој што беше формирани ова обвинителство кое требаше да биде професионална и независна институција, Antonio Miloshoski член на ИК на ВМРО-ДПМНЕ','2016-04-23 15:26:25',25,422,10,457,'90137764259'),('10154228429904260','http://vmro-dpmne.org.mk/?p=33796','Претседателот на ВМРО-ДПМНЕ Nikola Gruevski во рамки на денешната посета на сточарска фарма во селото Нова Брезница, општина Сопиште ја промовираше новата мерка со која значително ќе им се помогне на сточарите\n\nКако што истакна Груевски новата мерка ќе биде во изборната програма на ВМРО-ДПМНЕ, а ќе стапи на сила од 1 јануари идната година. Со истата ќе се субвенционираат 80% од сумата на сточарите кои ја потрошиле во набавка на високо приносен добиток','2016-04-23 16:30:12',480,746,107,1333,'90137764259'),('10154228769124260','https://www.facebook.com/spasovd/videos/538833576304258/','','2016-04-23 19:28:15',0,177,0,177,'90137764259'),('10154228802799260','http://vmro-dpmne.org.mk/?p=33801','Изминатите 6 месеци се можност за сите граѓани да се потсетат, а помладите генерации да видат каков е начинот на владеење на функционерите од редовите на СДСМ. Изминатите шест месеци се одбележани со многу закочени проекти, со нула реализирани нови проекти, со големи партиски притисоци врз администрацијата, со голем број разрешувања на раководители на институции, директори и местење на партиски кадри од СДСМ, незаконско именување на директори\n\nОва го истакна заменик министерот за труд и социјална политика Диме Спасов говорејќи за состојбите во Министерството по доаѓањето на техничката министерка Фросина Ременски во истото','2016-04-23 19:45:36',18,352,13,383,'90137764259'),('10154228825174260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154228825174260/?type=3','Пет години од отворањето на Спомен куќата на Тоше Проески, сабота, 23 април 2016','2016-04-23 20:00:22',284,2999,47,3330,'90137764259'),('10154230702074260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154230702074260/?type=3','Лидерот на ВМРО-ДПМНЕ Никола Груевски во посета на фарма во с.Нова Брезница, сабота, 23 април 2016','2016-04-24 15:53:36',284,2999,47,3330,'90137764259'),('10154232837039260','http://vmro-dpmne.org.mk/?p=33806','Граѓаните до крајот на месецов ќе може да аплицираат за мерката грант за самовработување. За оваа мерка годинава се предвидени 207 милиони денари, а ќе се поддржат околу 920 нови бизниси. (Диме Спасов)','2016-04-25 13:47:41',343,643,87,1073,'90137764259'),('10154232925834260','http://vmro-dpmne.org.mk/?p=33810','Продолжува непринципиелното и неизбалансирано информирање на дел од медиумите кои се дел од насилните и вандалски протести организирани од СДСМ и Сорос.','2016-04-25 14:31:35',13,252,7,272,'90137764259'),('10154233012434260','http://vmro-dpmne.org.mk/?p=33813','Од почетокот на следната недела стартуваат обуките за млади лица за изучување на англиски, германски и француски јазик. Првичните групи за обуки веќе се во фаза на формирање, а во следниот период лицата кои аплицираа ќе бидат известени за конкретната временска табела согласно која ќе треба да ги посетуваат обуките кои ќе се вршат од страна на специјализирани обучувачи','2016-04-25 15:06:41',28,273,3,304,'90137764259'),('10154233052524260','http://vmro-dpmne.org.mk/?p=33816','Нов ехо кардиограф, биохемиски анализатор и пет апарати во делот на физикалната терапија се ставени во употреба во Поликлиниката Чаир во Скопје','2016-04-25 15:31:24',10,197,1,208,'90137764259'),('10154233419034260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154233359379260/?type=3','Попоски во посета на Исламска Република Иран, понеделник, 25 април 2016','2016-04-25 18:42:51',293,3141,53,3487,'90137764259'),('10154233564054260','http://vmro-dpmne.org.mk/?p=33824','Започнаа градежните работи за темелна обнова на булеварот Ѓорче Петров. Реконструкцијата која ќе се изврши во должина од 1245 метри, ќе започне од кружниот тек кај СП Планет, па се до општината Ѓорче Петров','2016-04-25 20:01:54',315,582,68,965,'90137764259'),('10154234972964260','http://vmro-dpmne.org.mk/?p=33827','Граѓаните ги користат активните мерки на Владата за вработување. Било да се работи за проектите за млади, за отворање сопствени бизниси, за самовработување, за разните обуки и практики, мерките се ползуваат и се отвораат нови работни места. Домашните компании го препознаа потенцијалот, имаат бенефит од разните олеснувања, доаѓаат до кадар со ниски трошоци, што го придвижува економското тркало во насока на развојот','2016-04-26 11:37:01',193,303,56,552,'90137764259'),('10154235350479260','http://vmro-dpmne.org.mk/?p=33830','Непринципиелното и неизбалансирано информирање на дел од медиумите кои учествуваат во вандалските протести на СДСМ и Сорос продолжува без застој.','2016-04-26 15:03:13',2,77,1,80,'90137764259'),('10154235364794260','http://vmro-dpmne.org.mk/?p=33831','Музичарите од Македонската филхармонија по седум децении музицирање во импровизирани услови конечно ќе добијат нова концертна сала и професионални услови за работа како што заслужуваат. Зградата на Македонската филхармонијата е во завршна фаза и се очекува да биде готова до јануари наредната година.','2016-04-26 15:20:00',4,103,3,110,'90137764259'),('10154235392094260','http://vmro-dpmne.org.mk/?p=33836','Кај 19.000 жени и 5.700 мажи утврдено е дека имаат низок ризик за кардиоваскуларни заболувања, кај околу 10.000 мажи и околу 5.000 жени откриен е среден ризик, а кај 172 мажи и една жена откриен е висок ризик од кардиоваскуларна фатална епизода во наредните десет години.','2016-04-26 15:35:00',4,24,0,28,'90137764259'),('10154235603489260','http://vmro-dpmne.org.mk/?p=33848','Вратите на меѓународните финансиски институции за Македонија не се затворени, иако некои медиуми тоа го тврдат, вели министерот за финансии, Зоран Ставрески','2016-04-26 17:34:00',428,908,94,1430,'90137764259'),('10154235696134260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154235683889260/?type=3','Работна посета на Министерката за култура Канческа-Милевска на новиот објект на „Македонската филхармонија“, вторник, 26 април 2016','2016-04-26 18:11:20',303,3174,53,3530,'90137764259'),('10154237287004260','http://vmro-dpmne.org.mk/?p=33864','Политичката криза мора да има завршница, бидејќи во спротивно и најјаката економија на светот не би можела да издржи долгогодишна криза. Вистинска штета е што добро поставените економски политики не можат да резултираат со економскиот раст кој Македонија има потенцијал да го оствари. Македонската економија во моментов има потенцијал да расте со стапка од 4 до 5 проценти, вели министерот за финансии, Зоран Ставрески','2016-04-27 11:36:11',380,801,75,1256,'90137764259'),('10154237705734260','http://vmro-dpmne.org.mk/?p=33869','Заменик министерот за труд и социјална политика Диме Спасов и директорот на Агенцијата за вработување на Република Македонија Влатко Поповски, денес остварија средба со 15 –тина лица со инвалидност кои што се дел од обуката за мерката самовработување со грант средства за лица со инвалидност.','2016-04-27 15:17:12',12,155,0,167,'90137764259'),('10154237709494260','http://vmro-dpmne.org.mk/?p=33872','Индустриското производство во првиот квартал од годинава споредено со тој период лани е зголемено за 10,7 проценти, објави денеска Државниот завод за статистика (ДЗС).','2016-04-27 15:30:00',10,183,1,194,'90137764259'),('10154237711619260','http://vmro-dpmne.org.mk/?p=33877','Во минатите два месеца седум лаборатории се комплетно акредитирани со околу сто нови методи. Со нив, вкупно 18 лаборатории се акредитирани, т.е. покрај научно-истражувачка имаат апликативна (практична) намена и може да ги користат компании за своите потреби.','2016-04-27 15:21:03',400,598,83,1081,'90137764259'),('10154237713974260','http://vmro-dpmne.org.mk/?p=33881','Во тек се два огласи за издавање под закуп на 4.426 хектари државно земјоделско земјиште, во 20 општини во државата за површини над 3 хектари, со што се продолжува веќе воспоставената пракса за постојано објавување на слободното државно земјоделско земјиште под закуп што претставува постојано барање на земјоделците и компаниите од агро секторот.','2016-04-27 15:50:00',6,131,0,137,'90137764259'),('10154237836169260','http://vmro-dpmne.org.mk/?p=33884','Граѓаните се гневни на СДСМ за уништувањето на се што е македонско, за урнисувањето на спомениците на македонските херои, за сквернавењето на споменот на АСНОМ-ците, на војводите, на Децата бегалци и останатите жртви за суверена Македонија кои сега, долги години по нивната смрт, станаа повторно жртви на фрустрациите на СДСМ.','2016-04-27 16:29:03',18,367,10,395,'90137764259'),('10154237975744260','http://vmro-dpmne.org.mk/?p=33887','Претседателот на ВМРО-ДПМНЕ г. Nikola Gruevski денес оствари средба со известителите на Комисијата за почитување на обврските и заложбите на земјите членки на Советот на Европа\n\nСоговорниците разговараа за актуелната политичка состојба, наметнатата криза, како и интеграциските процеси важни за државата','2016-04-27 17:49:50',336,541,73,950,'90137764259'),('10154238015914260','http://vmro-dpmne.org.mk/?p=33889','Продолжува непринципиелното и неизбалансирано информирање на дел од медиумите кои се дел од насилните и вандалски протести организирани од СДСМ и Сорос\n\nОвие медиуми отстапуваат илјадници секунди секој ден и објавуваат стотици нарачани написи во полза на лагите и манипулациите на СДСМ, додека истовремено ги извртуваат ставовите и неаргументирано го напаѓаат ВМРО-ДПМНЕ','2016-04-27 18:17:42',6,131,2,139,'90137764259'),('10154238109189260','https://www.facebook.com/vmromakedonija/photos/a.10154173046579260.1073741902.90137764259/10154237901029260/?type=3','Активности за месец април 2016 година www.vmro-dpmne.org.mk','2016-04-27 19:08:40',305,3217,54,3576,'90137764259'),('10154238256744260','http://vmro-dpmne.org.mk/?p=33894','СДСМ нема кредибилитет да зборува за медиумски слободи и закани кон новинари, кога токму тие се организатори на хајки кон медиумски куќи и новинари','2016-04-27 20:15:56',11,236,1,248,'90137764259'),('1041130055947713','http://bdi.mk/lajmi.php?id=4872','','2016-02-24 19:13:50',4,89,1,94,'114081605319234'),('1042065909187461','http://bdi.mk/lajmi.php?id=4874','','2016-02-26 12:45:53',2,38,0,40,'114081605319234'),('1042110562516329','http://bdi.mk/lajmi.php?id=4876','','2016-02-26 14:47:19',0,22,0,22,'114081605319234'),('1042139609180091','http://bdi.mk/lajmi.php?id=4877','','2016-02-26 15:45:42',1,26,0,27,'114081605319234'),('1042142219179830','https://www.facebook.com/114081605319234/photos/a.114106278650100.14367.114081605319234/1042141272513258/?type=3','Ja si do duket konvikti i studentëve të Universitetit të Tetovës\n\nEdhe studentët e Universitetit të Tetovës me konvikt\nMinistria e arsimit dhe shkencës ka hapur tender për ndërtimin e Konviktit të studentëve të UT-së në Tetovë. Konvikti do të ndërtohet në kampusin universitar në Tetovë dhe do të jetë me kapcitet prej 350 shtretër me mundësi zgjerimi edhe për 150 shtretër plotësuese.\n\nObjekti do të jetë në podrum, përdhesë dhe 5 kate, i pajisur me kuzhinë, restorant, hapësirë për leximore, me dhoma me nga dy shtretër, internet dhe televizor në cdo dhomë dhe pjesë tjera të nevojshme për studentët.\n\nMe ndrtimin e këtij objekti do të plotësohet nevoja për vendosjen dhe banimin e studentëve të UT, që deri më tani ka munguar dhe kryesisht kanë qenë të vendosur në për banesa private.\nMASH parasheh edhe themelimin e subjektit juridik që do të menaxhojë me konviktin në Tetovë.\n\nNdërtimi I konviktit në Tetovë u paralajmërua ditën kur Qeveria e miratoi ligjin për themelimin e Universitetit “Nënë Tereza” në Shkup dhe themelimin e dy fakulteteve të reja në kuadër të Universitetit të Tetovës (Fakultetiti Pedagogjik dhe Fakultetit të Bujqësisë dhe bioteknologjisë).\n\nNga MASH njoftojnë se ky konvikt do të jetë ndër më të mirët në vend dhe se do të plotësojë të gjitha kushtet e nevojshme për standart studentor.','2016-02-26 15:53:23',4,142,0,146,'114081605319234'),('1042264909167561','https://www.facebook.com/AliAhmetiOfficial/photos/a.455072844529255.92479.454337564602783/1004157616287439/?type=3','','2016-02-26 20:11:14',0,21,0,21,'114081605319234'),('1042265099167542','https://www.facebook.com/AliAhmetiOfficial/photos/a.455072844529255.92479.454337564602783/1004157616287439/?type=3','','2016-02-26 20:11:49',0,55,1,56,'114081605319234'),('1042281482499237','http://bdi.mk/lajmi.php?id=4879','','2016-02-26 20:55:53',5,70,0,75,'114081605319234'),('1043802902347095','http://www.bdi.mk/lajmi.php?id=4880','','2016-02-29 14:26:28',0,15,0,15,'114081605319234'),('1043803629013689','http://www.bdi.mk/lajmi.php?id=4881','','2016-02-29 14:28:21',0,38,0,38,'114081605319234'),('1044270185633700','http://www.bdi.mk/lajmi.php?id=4884','','2016-03-01 13:14:13',2,31,0,33,'114081605319234'),('1044270778966974','http://www.bdi.mk/lajmi.php?id=4883','','2016-03-01 13:15:30',3,37,0,40,'114081605319234'),('1044272058966846','http://www.bdi.mk/lajmi.php?id=4882','','2016-03-01 13:19:55',0,19,0,19,'114081605319234'),('1044469058947146','http://www.bdi.mk/lajmi.php?id=4885','','2016-03-01 19:48:11',3,33,1,37,'114081605319234'),('1044993408894711','http://www.bdi.mk/lajmi.php?id=4886','','2016-03-02 17:22:45',0,70,0,70,'114081605319234'),('1045022392225146','http://www.bdi.mk/lajmi.php?id=4887','','2016-03-02 18:30:12',8,50,0,58,'114081605319234'),('1045054002221985','https://www.facebook.com/114081605319234/photos/a.114106278650100.14367.114081605319234/1045054002221985/?type=3','Sonte në selinë e Bashkimit Demokratik për Integrim në Shkup, drejuesit e të gjitha degëve të kryeqytetit të Dardanisë, bashkë me anëtarët e Kryesisë Qëndrore të BDIsë, demonstruan unitet dhe përkushtim të përbashkët për të kundërshtuar keqpërdorimin e simboleve fetare për qëllime politike dhe partiake. \n\nAndaj, ne të gjithë bashkarisht, ftojmë të gjitha mediat, shoqërinë civile dhe qytetarët që ta kundërshtojmë njëzëri proektin përçarës dhe nxitës në Komunën e Butelit. \n\nProtesta paqësore do të mbahet nesër, e enjte, më 3 mars 2016, para Komunës së Butelit.','2016-03-02 20:01:34',44,203,16,263,'114081605319234'),('1045371012190284','','Të lyp vendi edhe ty sot në ora 17:00 te stadiumi i Çairit.\n\nTë gjithë bashkë, në mënyrë paqësore, të shprehim mospajtimin tonë për keqpërdorimin e simboleve fetare për qëllime politike dhe përçarëse.','2016-03-03 09:16:17',7,56,1,64,'114081605319234'),('1045511268842925','http://bdi.mk/lajmi.php?id=4888','','2016-03-03 14:20:21',0,17,0,17,'114081605319234'),('1045511405509578','http://bdi.mk/lajmi.php?id=4892','','2016-03-03 14:20:53',2,34,1,37,'114081605319234'),('1045511602176225','http://bdi.mk/lajmi.php?id=4891','','2016-03-03 14:21:27',2,49,0,51,'114081605319234'),('1046084688785583','https://www.facebook.com/114081605319234/photos/a.114106278650100.14367.114081605319234/1046084535452265/?type=3','Vazhojnë punimet intenzive në stadiumin e qytetit në Tetovë. \n\nAktualishtë punohet në rrjetin elektrik për kyçjen e ndriçimit gjegjësishtë reflektorëve të stadiumit.\n\nMe finalizimin e punimeve do ti hapet rrugë edhe partneritetit-publiko privat, me ç’rast sportdashësit tetovarë do të mund ti ndjekin ndeshjet futbollistike në qytetin amë.','2016-03-04 17:58:52',0,33,0,33,'114081605319234'),('1046544395406279','https://www.facebook.com/AliAhmetiOfficial/photos/a.455072844529255.92479.454337564602783/1008099689226565/?type=3','','2016-03-05 12:26:12',0,55,0,55,'114081605319234'),('10482810718992