p://goo.gl/c6TGEh','2016-03-17 19:57:17',23,229,2,254,'148427235188637'),('1104240522940632','http://www.sdsm.org.mk/News.aspx?idNews=1217&lng=1','На Македонија и требаат промени. Да станеме држава којашто ќе ги зачува овие млади тука. Да се свртиме кон граѓаните и нивните потреби, да се свртиме кон нашите села и градови. Парите да не ги трошиме на споменици, туку за граѓаните','2016-03-17 21:17:46',14,368,6,388,'148427235188637'),('1104725639558787','http://sdsm.org.mk/News.aspx?idNews=1220&lng=1','Ги повикуваме сите заинтересирани да се пријават и својата кратка биографија да ја испратат ја на следниот e-mail: volonter.sdsm@sdsm.org.mk Рокот за пријавување е најдоцна до 22.03.2016 г.','2016-03-18 13:23:41',61,323,5,389,'148427235188637'),('1104804592884225','http://www.sdsm.org.mk/News.aspx?idNews=1224&lng=1','Она што сакам уште еднаш да го потврдам е дека преку 200.000 граѓани мора теренски да бидат проверени. Пришто ќе се оддели делот кои се граѓани гласачи што живеат во странство, и делот кои се фиктивни гласачи, за на крајот да бидат избришани од избирачкиот список. Без овој процес, нема фер и демократски избори. Без регулација и реформи во медиумите, нема фер и демократски избори','2016-03-18 15:42:22',24,392,5,421,'148427235188637'),('1104830202881664','http://www.sdsm.org.mk/News.aspx?idNews=1226&lng=1','Луѓе блиски до ВМРО-ДПМНЕ, вработени во провладините маедиуми, до СДСМ доставија информации: куќниот пријател на Никола Груевски, уредникот на Сител, Драган Павловиќ Латас додека затвора едни, отвора други фирми. Четири фирми, за само три години, оствариле приходи од над 736 илјади евра','2016-03-18 16:22:56',20,290,8,318,'148427235188637'),('1104850699546281','http://www.sdsm.org.mk/News.aspx?idNews=1227&lng=1','Оттука децидно изјавуваме дека овој центар ќе продолжи да функционира, да ја спроведува програмата којашто ја има склучено со Министерството за труд и социјална политика, а ние го поддржуваме. И се додека општината не смогне сили да обезбеди локација којашто би била соодветна на квадратурата и потребите на овој дневен центар, центарот ќе продолжи да функционира како што е','2016-03-18 17:01:42',12,243,3,258,'148427235188637'),('1104900539541297','http://www.sdsm.org.mk/News.aspx?idNews=1229&lng=1','Едно е јасно дека нашата соработка ќе ја продлабочуваме се повеќе, ќе направиме што е можно повеќе заеднички контроли на границата на Република Македонија и на Република Бугарија, да се интензивира сето тоа за да не дозволиме да се отвори нов коридор за бегалци кои што ќе поминува низ Република Македонија и Република Бугаријa','2016-03-18 18:05:28',8,247,1,256,'148427235188637'),('1104921639539187','http://www.sdsm.org.mk/News.aspx?idNews=1231&lng=1','Стотици илјади гласачи се спорни. За тоа Груевски даде оставка. Што мисли Иванов, Груевски не е легитимен, а тој е легитимен? Ѓорѓе Иванов треба да даде оставка и Македонија да добие легитимен претседател на државата кој ќе работи во интерес на сите граѓани на Република Македонија','2016-03-18 18:48:12',36,428,6,470,'148427235188637'),('1105340902830594','http://sdsm.org.mk/News.aspx?idNews=1232&lng=1','Ќе направиме ревизија на земјоделските земјишта и ќе ги вратиме на вистинските земјоделци. Ќе ги зголемиме субвенциите на 160 милиони евра. За да ги задржиме младите, ќе отвориме регионални бизнис инкубатори и ќе обезбедиме 10.000 евра неповратни средства за отварање сопствен бизнис. Минималната плата ќе ја зголемиме, а просечната ќе достигне до над 29 илјади денари','2016-03-19 09:07:46',8,246,2,256,'148427235188637'),('1105473556150662','http://www.sdsm.org.mk/News.aspx?idNews=1236&lng=1','Груевски и неговите соработници се исплашија од илјадниците фантоми што им излегоа и сега не сакаат на терен. Но нема веќе што сака Груевски. Избирачкиот список мора да се прочисти, теренска проверка мора да има, мора да има и медиумски реформи. Граѓаните сакаат фер и регуларни избори и само такви избори ќе се случат во Република Македонија','2016-03-19 13:57:50',23,235,10,268,'148427235188637'),('1105493136148704','http://www.sdsm.org.mk/News.aspx?idNews=1237&lng=1','ДИК, како независна институција, треба максимално да посвети внимание да се исчисти избирачкиот список и да се создаде сигурност кај граѓаните на Република Македонија дека избирачкото право не може да биде злоупотребено','2016-03-19 14:45:30',10,379,0,389,'148427235188637'),('1105593996138618','http://www.sdsm.org.mk/News.aspx?idNews=1239&lng=1','Без прочистување на избирачкиот список нема фер, регуларни и демократски избори. Тоа што е за теренска проверка мора да оди на теренска проверка. Се друго е неприфатливо. Ако има прочистен избирачки список и реформи во медиумите на 5-ти јуни ќе се случат промените. Ако не, штом има прочистен избирачки список и реформи во медиумите, тогаш ќе се случат изборите','2016-03-19 17:25:42',19,472,0,491,'148427235188637'),('1105612796136738','http://www.sdsm.org.mk/News.aspx?idNews=1240&lng=1','Никој нека не размислува за криминални избори, тоа нема да го дозволиме. Секој што го прекршил законот ќе одговара','2016-03-19 18:01:41',19,396,6,421,'148427235188637'),('1105710316126986','http://sdsm.org.mk/News.aspx?idNews=1243&lng=1','Денеска вистински патриот е тој кој ќе обезбеди работни места за младите и ние сме фокусирани на тоа, да си ги задржиме младите дома','2016-03-19 20:56:46',2,299,0,301,'148427235188637'),('1106102462754438','http://sdsm.org.mk/News.aspx?idNews=1236&lng=1','','2016-03-20 09:35:49',0,147,2,149,'148427235188637'),('1106302819401069','http://www.sdsm.org.mk/News.aspx?idNews=1250&lng=1','Груевски не сака да бидат проверени на терен сите оние негови измислени гласачи затоа што тие години наназад му ја обезбедувале победата. Меѓутоа, СДСМ е исправен пред принципиелната битка за вистината и правдата во Македонија и ние во таа цел ќе успееме. Нема да отстапиме ни милиметар од нашите барања за регулирање на медиумскиот простор и за целосно прочистување на избирачкиот список со теренска проверка','2016-03-20 15:58:46',21,499,9,529,'148427235188637'),('1106343212730363','http://www.sdsm.org.mk/News.aspx?idNews=1251&lng=1','ДИК потврди дека постои огромен број на спорни гласачи. Над 310.000! СДСМ инсистира на темелна проверка на сомнителните записи во Избирачкиот список, за да може сите фантомски гласачи, недоследности, проблематично внесени податоци да се избришат и на тој начин да се врати довербата на граѓаните во Избирачкиот список','2016-03-20 17:19:48',14,285,6,305,'148427235188637'),('1106428282721856','https://www.facebook.com/SDSMakedonija/videos/1106428282721856/','#ИмаРазлика Неопходни се реформи на медиумите!','2016-03-21 10:00:07',307,628,35,970,'148427235188637'),('1106982562666428','http://www.sdsm.org.mk/News.aspx?idNews=1257&lng=1','Денешниот театар на ВМРО-ДПМНЕ е уште една потврда за стравот на Никола Груевски да се соочи со одговорноста за криминалите. Очигледно е дека ВМРО ДПМНЕ и нема намера да дебатира по извештајот на Специјалното јавно обвинителство','2016-03-21 13:31:33',69,320,10,399,'148427235188637'),('1107000122664672','http://www.sdsm.org.mk/News.aspx?idNews=1258&lng=1','Aко е падната цената на електричната енергија на слободниот пазар, Регулаторната комисија за енергетика и дозволува на ЕВН да набавува струја поскапа за 20 евра по мегават час? Каде завршуваат 41.7 проценти вишок пари, земени од граѓаните на Република Македонија, со дозвола на Регулаторната комисија за енергетика?','2016-03-21 14:08:43',61,150,13,224,'148427235188637'),('1107026882661996','http://www.sdsm.org.mk/News.aspx?idNews=1259&lng=1','Во Македонија владее криминална банда без легитимитет којашто не само што ги крадела парите на граѓаните туку го украла и нивниот глас. ДИК е должна да и презентира на јавноста патоказ по којшто ќе се дојде до легитимен избирачки список. Не смее да има сомнеж во ниту еден глас. Мора да важи правилото еден човек-еден глас. Без целосно прочистен избирачки список нема фер, демократски и регуларни избори','2016-03-21 14:59:17',57,291,7,355,'148427235188637'),('1107135139317837','https://www.facebook.com/SDSMakedonija/photos/a.1107134832651201.1073742094.148427235188637/1107135139317837/?type=3','Стотиците илјади сомнителни и фантомски гласачи го потврдија во целост изборниот криминал на Никола Груевски. Не само што ги крадел парите од граѓаните, го крадел и вашиот глас. Затоа, секој што сторил изборна измама треба да одговара. Слободниот глас на граѓаните, демократскиот принцип еден човек-еден глас мора да биде обезбеден. За тоа да се случи, избирачкиот список мора да се прочисти во целост. Мора да имаме слободни избори со прочистен избирачки список и реформи во медиумите. Промените ќе се случат на фер избори http://goo.gl/RRqw3A','2016-03-21 18:07:24',38,405,10,453,'148427235188637'),('1107137405984277','http://www.sdsm.org.mk/News.aspx?idNews=1262&lng=1','Нашиот план е да стимулираме подобро платени места. Целта ни е просечната плата во Македонија да изнесува над 29 илјади денари. Со закон ќе ја зголемиме и минималната плата. Сметаме дека само на ваков начин ќе ги задржиме младите во Македонија и на ваков начин ќе создадеме шанса за создавање семејства дома, наместо заминување во странство','2016-03-21 18:40:00',13,400,1,414,'148427235188637'),('1107218225976195','http://sdsm.org.mk/News.aspx?idNews=1264&lng=1','Актуелната власт владеела не само со уцени и притисоци туку владеела со фантомски гласачи, измислени списоци и многу државни пари потрошени за партиска сметка. Без чистење на избирачкиот список граѓаните нема да имаат верба во изборите','2016-03-21 20:25:00',6,268,3,277,'148427235188637'),('1107739349257416','http://sdsm.org.mk/News.aspx?idNews=1267&lng=1','Венецијанската комисија веќе го донесе Мислењето за Законот за приватност и за Законот за пријавувачи, кои беа предмет на спогодба во рамките на спроведувањето на Договорот од Пржино. Како дел од договорот, четирите политички партии од Работната група презедоа обврска да ги изменат овие закони согласно Мислењето на Венецијанската комисија','2016-03-22 10:51:18',37,285,4,326,'148427235188637'),('1107853305912687','http://sdsm.org.mk/News.aspx?idNews=1268&lng=1','Очигледно е дека стравот на ВМРО-ДПМНЕ од работата на СЈО ги принудува да се однесуваат хаотично и дополнително да се заплеткуваат во небулозни ситуации кои значат само дополнително фрлање буџетски пари, пари на граѓаните. Неделовничкото однесување на г. Ѓорчев го чини пари ова Собрание, меѓу другото и за патни трошоци на пратениците кои и вчера и денес дојдоа за седница на комисијата која не ни започна.','2016-03-22 14:04:42',45,157,2,204,'148427235188637'),('1107881735909844','http://sdsm.org.mk/News.aspx?idNews=1271&lng=1','Вака изгледа лажниот патриотизам на ВМРО-ДПМНЕ којшто го кријат медиумите под нивна контрола. Војниците на АРМ спијат во руинирани гаражи, во шатори полни со вода, без греење','2016-03-22 15:01:02',86,252,12,350,'148427235188637'),('1108140129217338','http://sdsm.org.mk/News.aspx?idNews=1274&lng=1','Избирачкиот список мора да се прочисти целосно. Сите политички чинители да имаат целосна доверба во процесот на чистење на избирачкиот список. За слободни, фер и демократски избори мора да има чист избирачки список и слободн регулирање на медиумскиот простор','2016-03-22 20:39:28',13,276,2,291,'148427235188637'),('1108163112548373','https://www.facebook.com/SDSMakedonija/photos/a.1108162905881727.1073742095.148427235188637/1108163112548373/?type=3','Хаосот којшто го создадоа Никола Груевски и ВМРО-ДПМНЕ е повеќе од јасен. Видовте и самите, освен што ги краделе парите од џебот на македонскиот граѓанин, го краделе и вашето право на глас. 330.000-те спорни гласачи во избирачкиот список коишто треба да се проверат, се најдобар доказ за тоа. Никола Груевски се плаши од чист избирачки список, бидејќи на избори со чист список тој ќе изгуби http://goo.gl/OlTkWs','2016-03-22 21:02:41',16,304,1,321,'148427235188637'),('1108710689160282','http://sdsm.org.mk/News.aspx?idNews=1278&lng=1','Ништо нема да го спаси Груевски од одговорноста за изборниот криминал и криминалниот начин на владеење. Сега е потребно да се обезбеди навремено и целосно прочистување на избирачкиот список за да може секој граѓанин да одлучува по сопствена волја според основниот демократски принципи, еден човек-еден глас. Тоа е основен услов за фер избори. А на фер и демократски избори победува СДСМ, победуваат граѓаните, доаѓаат промените','2016-03-23 12:07:44',8,171,1,180,'148427235188637'),('1108788909152460','http://sdsm.org.mk/News.aspx?idNews=1281&lng=1','Со овој предлог Законот ја пополнуваме правната празнина која ја создаде Уставниот суд и предвидуваме правила кои ќе ги обесхрабри терористите и другите потенцијални сторители на кривични дела. Исто така оневозможуваме едно лице да биде помилувано за повеќе кривични дела','2016-03-23 14:26:52',47,212,15,274,'148427235188637'),('1108815742483110','http://sdsm.org.mk/News.aspx?idNews=1284&lng=1','ВМРО-ДПМНЕ, преку Владата и министерството за здравство ги укина мерките за штедење во здравството донесени во 2012 година. Тоа значи зголемување на паушалите и надоместоците на членовите на Управни и Надзорни одбори, односно богатење на партиските послушници на ВМРО-ДПМНЕ и Никола Груевски.  Сето ова се случува во време кога јавното здравство се соочува со колапс поради криминалните политики на Груевски и Тодоров','2016-03-23 15:10:10',44,124,11,179,'148427235188637'),('1109048009126550','http://sdsm.org.mk/News.aspx?idNews=1293&lng=1','СДСМ создавајќи ја својата програма заедно со граѓаните е за Македонија како еднакво, солидарно и напредно општество. Првенствено наша цел е да ги задржиме младите со обезбедување на нови работни места и развивање на младинскиот претприемнички дух. СДСМ ќе отвори бизнис инкубатори во сите региони, со обезбедени 10.000 евра неповратни средства, за младите да можат да отворат сопствен бизнис. Целта на СДСМ е отворање на нови места но со достоинствени повисоки плати. Со СДСМ просечната плата ќе изнесува над 29.000 денари','2016-03-23 20:36:20',37,252,21,310,'148427235188637'),('1109068982457786','http://sdsm.org.mk/News.aspx?idNews=1294&lng=1','На следните фер и демократски избори ќе се случат промени. Груевски и ВМРО-ДПМНЕ ќе бидат минато. Новата, одговорна влада предводена од СДСМ бескомпромисно ќе се бори против корупцијата и криминалот. Нема да дозволиме да има селективна правда во Македонија','2016-03-23 20:59:41',27,374,9,410,'148427235188637'),('1109780205719997','http://www.sdsm.org.mk/News.aspx?idNews=1298&lng=1','ВМРО-ДПМНЕ секој ден покажува колку се плаши од соочување со одговорноста за целокупниот криминал во изминатите 10 години. Секојдневниот театар на ВМРО-ДПМНЕ со тоа што не започнува дебата по Извештајот на СЈО, го потврдува хаосот во оваа партија.  Пратениците од СДСМ и опозицијата нема да присуствуваат на циркусот во режија на ВМРО-ДПМНЕ','2016-03-24 11:37:30',58,277,3,338,'148427235188637'),('1109828955715122','http://www.sdsm.org.mk/News.aspx?idNews=1299&lng=1','Земјоделците имаат право да знаат дека Груевски ја делел земјата на криминален начин. Земјоделците имаат право да знаат како  фирми блиски на власта незаконски се ослободувале од плаќање на закупнина додека на вистинските земјоделци, ако еден ден закаснат со плаќање им се укининуваат субвенциите. На самоволието на функционерите на Груевски му доаѓа крајот. Ќе ја исправиме оваа неправда. По промените доаѓа вистинска грижа за земјоделците и земјоделското производство','2016-03-24 13:23:12',33,256,9,298,'148427235188637'),('1110660788965272','https://www.facebook.com/SDSMakedonija/photos/a.1110660488965302.1073742096.148427235188637/1110660788965272/?type=3','Имаме ненародна, криминална власт која потроши 630 милиони евра на споменици и мисли само на личниот интерес. Институциите се партизирани и неефикасни, не работат во интерес на граѓаните. Тоа мора да се промени и во Македонија да се вратат вистинските вредности. СДСМ има програма и остварливи, реални цели. Институциите да се департизираат и да работат во интерес на граѓаните. Младите наместо да ја напуштаат земјата да добијат сигурна работа со поголема плата http://goo.gl/gRCECl','2016-03-25 09:10:34',29,317,11,357,'148427235188637'),('1110757802288904','http://www.sdsm.org.mk/News.aspx?idNews=1308&lng=1','Ќе застанеме на патот на урбаната мафија. Не е дозволиво во подножјето на Водно да се градат висококатници и да се уништува зеленилото, а на неколку метри од тука да нема ни водовод ни канализација, да нема основни услови за живот. Приоритетите мора да се променат и ќе ги промениме. Се додека во секоја општина, град, село, не биде решен проблемот со водоводот, канализацијата, училиштата и амбулантите не можеме да зборуваме за модерна и успешна Македонија. СДСМ има програма и план со реални, остваливи цели и ние тоа ќе го направиме','2016-03-25 11:21:28',14,290,12,316,'148427235188637'),('1110994118931939','http://www.sdsm.org.mk/News.aspx?idNews=1312&lng=1','Овој проект мора да продолжи заради тоа што сите професионални кадри во Министерството за внатрешни работи се длабоко свесни за важноста на ваквите проекти и развојот на полициското работење. Затоа што тоа пред се значи зголемување на интегритетот, ефикасноста и доближување на полицијата до граѓаните на Република Македонија, а од друга страна имаме градење на доверба на граѓаните кон македонската полиција','2016-03-25 17:09:44',10,273,2,285,'148427235188637'),('1111143588916992','https://www.facebook.com/SDSMakedonija/photos/a.1111143558916995.1073742097.148427235188637/1111143588916992/?type=3','Криминалната власт на Никола Груевски и ВМРО ДПМНЕ си заминуваат на следните фер и демократски избори. За секое зло што го нанесоа последните 10 години, ќе одговараат. Слободата, правдата, еднаквоста ќе ги вратиме назад. Промените што започнаа се незапирлив процес http://goo.gl/augY6W','2016-03-25 20:41:03',37,341,6,384,'148427235188637'),('1111907095507308','https://www.facebook.com/SDSMakedonija/photos/a.1111906832174001.1073742098.148427235188637/1111907095507308/?type=3','На следните фер и демократски избори, оваа ненародна власт ќе си замине во историјата. За секоја неправда што ја нанесоа, секое зло што го направија во последните 10 години ќе одговараат. СДСМ, којашто ќе ја предводи демократска, транспарентна и одговорна Влада, нема да се води од реваншизмот. Само со несебична посветеност на секој поединец со сите демократски сили, можеме да ја вратиме Македонија на патот на вистинските вредности http://goo.gl/ISj0AR','2016-03-26 16:04:10',36,406,5,447,'148427235188637'),('1111932458838105','http://www.sdsm.org.mk/News.aspx?idNews=1318&lng=1','Превентивно е зголемено присуството бидејќи навистина во овој период имаме сериозни предизвици коишто се и ризици за безбедноста и во Македонија, но и во регионот. Има бегалска криза и во рамките на сите овие активности МВР е со зголемено присуство овде во кумановскиот и во скопскиот регион. Сите треба сите да бидат спокојни, бидејќи МВР ги превзема сите мерки коишто значат засилување на безбедносната состојба во државата','2016-03-26 16:44:42',15,380,10,405,'148427235188637'),('1112742178757133','http://sdsm.org.mk/News.aspx?idNews=1325&lng=1','На Македонија и е потребна отчетна власт којашто на транспарентен начин ќе ги собира и ќе троши парите на граѓаните. Ќе овозможиме целосна контрола од самите граѓани врз трошењето на народните пари. Сите трошења на министрите и државните функционери ќе бидат јавно објавени и граѓаните ќе можат да проверуваат постојано како се трошат нивните пари','2016-03-27 14:58:38',37,201,1,239,'148427235188637'),('1112782292086455','https://www.facebook.com/SDSMakedonija/videos/1112782292086455/','Разговор со младите: СДСМ има Програма за сигурна иднина на младите во сопствената држава\n\nСДСМ има Програма за сигурна иднина на младите во сопствената држава, кадешто младите ќе имаат ќе имаат можност со своето знаење, труд и посветеност да добијат сигурна работа којашто нема да зависи од партиската книшка\nhttp://goo.gl/23bgei','2016-03-27 16:16:17',185,407,16,608,'148427235188637'),('1112825452082139','ht