ја за почит и респект од сите наши граѓани и од светот','2016-03-29 13:11:49',23,443,8,474,'148427235188637'),('1114716355226382','http://www.sdsm.org.mk/News.aspx?idNews=1339&lng=1','СДСМ го поддржува предлог Законот за реформи во медиумите поднесен од страна на новинарските здруженија. Не само усвојувањето туку и, потенцирам, имплементацијата на овој Закон е исклучително важна и нужна. За да има услови за фер и демократски избори мора да бидат избрани и конституирани новите членови Советот на АВМУ и Советот на МРТВ','2016-03-29 13:54:43',31,238,9,278,'148427235188637'),('1114755971889087','http://www.sdsm.org.mk/News.aspx?idNews=1342&lng=1','Со консензус ДИК констатираше дека има над 330.000 сомнителни гласачи. Тоа е најсериозна потврда дека последните неколку изборни циклуси во Македонија се нелегитимни. ДИК треба да одговори дали процесот за проверка на избирачкиот список е кредибилен? Дали знае како ќе се избришат гласачите кои согласно законот не треба да бидат на избирачкиот список? И најважното прашање, дали за изборите на 5-ти јуни е можно да имаме веродостоен избирачки список?','2016-03-29 14:49:18',12,266,15,293,'148427235188637'),('1114834935214524','http://sdsm.org.mk/News.aspx?idNews=1346&lng=1','СДСМ нуди мерки во делот на земјоделието и руралниот развој. Субвенциите ги зголемуваме на 160 милиони евра, но ќе ги добиваат вистинските земјоделци и тоа на време, тогаш кога им се потребни. Ќе воведеме зелена нафта за земјоделците, поефтина за 50%. Државата ќе се грижи за откупот и за пласманот на земјоделските производи. Ќе направиме ревизија на тоа како е доделена државната земја и ќе ја вратиме на вистинските земјоделци','2016-03-29 16:52:36',12,172,2,186,'148427235188637'),('1114864821878202','https://www.youtube.com/watch?v=E1lNvFrwPvw&feature=youtu.be','Одговорноста за работењето на фабриката за шински возила е целосно на Владата','2016-03-29 17:37:21',34,107,2,143,'148427235188637'),('1114951765202841','http://sdsm.org.mk/News.aspx?idNews=1349&lng=1'