'2016-03-30 21:15:01',9,182,3,194,'148427235188637'),('1116662995031718','http://www.sdsm.org.mk/News.aspx?idNews=1360&lng=1','Остануваме до крај на браникот на она за коешто се залагаме и на она што го очекува цела македонска јавност од нас, правото на слободно изразена волја на граѓаните, да гласот вреди еден глас и граѓаните слободно да одлучат за иднината на нашата земја','2016-03-31 11:54:57',24,428,4,456,'148427235188637'),('1116759978355353','http://www.sdsm.org.mk/News.aspx?idNews=1362&lng=1','На Македонија и е потребна транспарентна и одговорна Влада којашто ќе се справи со економскиот пустош што Груевски го остави зад себе. СДСМ ќе ја добие честа и довербата од граѓаните да ја предводи одговорната Влада којашто преку одговорни политики во економијата ќе работи на создавање реален економски амбиент којшто ќе создава реални работни места','2016-03-31 14:35:30',10,174,1,185,'148427235188637'),('1116784628352888','http://www.sdsm.org.mk/News.aspx?idNews=1363&lng=1','Бандата на Никола Груевски, Мијалков и Ставрески по секоја цена се обидува да го скире криминалот којштп е направен со избирачкиот список. Дирекцијата за заштита на личните податоци практично забранува објавувањето на избирачкиот список со што најдиректно го крши Изборниот законик и Договорот од Пржино. Јавно ја повикуваме ДИК, да не постапува по ова барање на криминалната банда','2016-03-31 15:15:36',25,210,4,239,'148427235188637'),('1116794808351870','http://www.sdsm.org.mk/News.aspx?idNews=1364&lng=1','Ова што го објавив, за злоупотребата на т.н.проект Комјутер за секое дете, е само мал дел од документите со коишто располагам, што ќе послужат во следните чекори што ќе ги преземам за веројатните злоупотреби во коишто се оштетни граѓаните','2016-03-31 15:58:00',43,253,6,302,'148427235188637'),('1116814041683280','http://www.sdsm.org.mk/News.aspx?idNews=1365&lng=1','Воведуваме дополнителна субвенција за тутунот од прва класа. Предвидуваме изградба на 600 километри автопатишта, меѓу коишто е и автоп