4900246','https://www.facebook.com/SDSMakedonija/photos/a.1117977404900277.1073742104.148427235188637/1117977714900246/?type=3','','2016-04-01 19:49:22',31,1134,10,1175,'148427235188637'),('1117982481566436','http://www.sdsm.org.mk/News.aspx?idNews=1380&lng=1','Преку силна поддршка на домашните мали и средни претпријатија, од 20-50 милиони евра државна финансиска помош, ќе се отворат нови работни места. Мерките во Програмата СДСМ ќе го зголемат стандардот на граѓаните и ќе допринесат за зголемување на минималната плата на 15 илјади денари, а просечната на над 29 илјади денари. Така ќе обезбедиме сигурна и подобра иднина, подобар живот на сите граѓани','2016-04-01 20:45:00',9,177,2,188,'148427235188637'),('1118362168195134','http://www.sdsm.org.mk/News.aspx?idNews=1384&lng=1','СДСМ ќе обезбеди 140 милиони евра поддршка за домашните мали и средни претпријатија коишто ќе придонесат за отворање на нови работи места со повисоки плати. Целта ни е да ја обновиме економијата, да се отворат нови работни места и да ја зголемиме просечната плата на над 29 илјади денари','2016-04-02 11:09:23',16,247,5,268,'148427235188637'),('1118435351521149','http://www.sdsm.org.mk/News.aspx?idNews=1385&lng=1','СДСМ во Програмата се обврзува на поддршка на лицата со попречености во нивните секојдневни потреби. Ќе имаат лични асистенти што ќе функционираат на локално ниво за да им помагаат','2016-04-02 13:49:13',11,131,3,145,'148427235188637'),('1118467974851220','http://www.sdsm.org.mk/News.aspx?idNews=1386&lng=1','Постапката за донесување на Деталниот урбанистички план е спорна и спротивна на интерсите на граѓаните. За Ивица Коневски и Никола Груевски не се важни потребите на граѓаните за чист воздух, спортски и детски игралишта, зелени, природни површини, не е важна пренаселеноста во овој дел од општината. Наместо интересите на граѓаните, за Ивица Коневски и Никола Груевски се важни само личните и бизнис интереси','2016-04-02 15:00:25',27,182,5,214,'148427235188637'),('1118510424846975','http://www.sdsm.org.mk/News.aspx?idNews=1387&lng=1','Во Програмата на СДСМ централно место завземаат мерките за младите луѓе. Преку директна финансиска поддршка на домашните мали и средни претпријатија од 140 милиони евра, ќе стимулираме отворање на нови работни места ама со достоинствени, повисоки плати. Ќе ја зголемиме минималната плата на 15 илјади денари а просечната ќе изнесува над 29 илјади денари. На тој начин ќе ги задржиме младите дома да ја градат својата иднина','2016-04-02 16:17:15',16,204,4,224,'148427235188637'),('1119117041452980','http://sdsm.org.mk/News.aspx?idNews=1393&lng=1','Преку една сериозна реформа во македонскиот безбедносен систем, во полицијата ќе создадеме услови со коишто граѓаните ќе имаат верба во полицијата, а полицијата ќе нуди и подобра заштита','2016-04-03 15:27:57',14,223,2,239,'148427235188637'),('1119186038112747','http://sdsm.org.mk/News.aspx?idNews=1394&lng=1','На фирмата Виста Груп и се префрлени речиси 1 милион евра без да го исполни договорот со Министерството за информатичко општество. За овој криминал знаеле и во Министерството и во Владата, молчеле и покривале. Продолжуваме да работиме на откривање на злоупотребите','2016-04-03 17:41:23',23,247,4,274,'148427235188637'),('1119191058112245','https://www.facebook.com/SDSMakedonija/photos/a.1119190951445589.1073742105.148427235188637/1119191058112245/?type=3','','2016-04-03 18:09:23',40,596,2,638,'148427235188637'),('1119650151399669','http://www.sdsm.org.mk/News.aspx?idNews=1401&lng=1','Ќе обезбедиме 140 милиони евра, неповратна државна помош за домашните мали и средни претпријатија, коишто ќе креираат нови работни места. Но, не било какви работни места, туку достоинствени работни места со повисоки плати и загарантирани работнички права. Завршува времето на експлоатацијата на работниците во Македонија. Минималната плата ќе ја зголемиме на 15 илјади денари а просечната ќе достигне до над 29 илјади денари','2016-04-04 11:47:48',15,244,0,259,'148427235188637'),('1119703084727709','https://www.youtube.com/watch?v=G6-zs-GZX7M&feature=youtu.be','Со овој закон сметаме дека ќе се изврши целосна департизација, поготово во Советот на Агенцијата за медиумски услуги и во МРТ, рече пратеникот Горан Сугарески во однос на предлогот на закон за изменување на Законот за аудио и аудиовизуелни медиумски услуги','2016-04-04 14:01:02',25,85,1,111,'148427235188637'),('1119752221389462','http://www.sdsm.org.mk/News.aspx?idNews=1404&lng=1','Јасно е. Се работеше за очајно предизборно сценарио. Рејтинзите на владејачките ВМРО-ДПМНЕ и ДУИ вртоглаво паѓаат. Како и секогаш, исто како и во 2014 година кога измислија проблем околу непостоечки „консензуален кандидат за претседател“, и сега се обидоа да играат на националистичка карта. Овој пат не им пројде. Преку Вистината за Македонија, граѓаните на Скопје од сите етнички заедници, и Македонци, и Албанци, и Турци, и Срби, и Роми, и Власи и сите останати, го видоа вистинското лице на власта','2016-04-04 14:33:24',10,206,2,218,'148427235188637'),('1119767934721224','http://www.sdsm.org.mk/News.aspx?idNews=1405&lng=1','Тимовите за внесување на податоците од теренската проверка на ДИК што сами ги составиле министерката Марта Арсовска Томовска и државниот секретар Јахија, без мој потпис, барам да бидат повлечени. Не смеат да внесуваат податоци додека не се обезбеди двојната контрола, предивидена со Договорот од Пржино','2016-04-04 15:19:07',17,231,4,252,'148427235188637'),('1119784284719589','http://www.sdsm.org.mk/News.aspx?idNews=1408&lng=1','Имаме многу сериозни мерки во врска со злоупоребите на милијарди евра пари на граѓаните. Целосно ќе ги департизираме државните институции. Само така е можна бескомпромисна борба против криминалот и корупцијата. По примерот на ЕУ ќе има заплена на имот стекнат со криминал и корупција, веднаш по правосилна пресуда','2016-04-04 15:56:24',83,273,14,370,'148427235188637'),('1119844681380216','https://www.facebook.com/SDSMakedonija/photos/a.1119844494713568.1073742106.148427235188637/1119844681380216/?type=3','','2016-04-04 18:19:37',38,416,0,454,'148427235188637'),('1120288044669213','http://sdsm.org.mk/News.aspx?idNews=1415&lng=1','Бараме да се отпочне со нова постапка за јавна набавка на Браната „Конско“ со што ќе се овозможи рационално и ефикасно искористување на парите на граѓаните. Институциите се должни до крај да го расветлат овој случај. Секој што го прекрши законот мора да одговара','2016-04-05 13:04:17',14,92,0,106,'148427235188637'),('1120314524666565','http://sdsm.org.mk/News.aspx?idNews=1417&lng=1','Преку оф-шор компании власта ја превзеде контролата на многу фукнционални фирми во државата. Во економијата во Македонија влегоа разни фирми регистрирани по швајцарски, панамски, сејшелски острови. Секоја фирма е добредојдена, ама оние што го кријат својот газда, пред идната одговорна власт и пред граѓаните на Р.Македонија ќе мора да покажат - кои се и што се. Чесните фирми и граѓани нема од што да се плашат, но оние од власта, коишто земале провизија од 16, 18, 36 милиони евра има од што да се плашат','2016-04-05 14:13:34',14,254,2,270,'148427235188637'),('1120356564662361','https://www.youtube.com/watch?v=kRiVKWnnPkw&feature=youtu.be','Одлуката на ДУИ да го повлече овој потег непосредно пред распуштањето на Парламентот и евентуалното одржување на избори, не е ништо туку значителен придонес на ДУИ во понатамошно комплицирање на и така сложената политичка ситуација во државата','2016-04-05 15:22:21',18,170,7,195,'148427235188637'),('1120359107995440','http://sdsm.org.mk/News.aspx?idNews=1418&lng=1','Це-Те Компјутерс или КомТрејд на која што Иво Ивановски и го дал 15-милионскиот бизнис е на сопственикот на Алфа ТВ, а со неа се поврзува и Жарко Луковски од Телеком, близок со Сашо Мијалков. Виста Груп што добила бизнис над 1 милион евра е во сопственост на братучед на Зоран Ставрески и син на пратеничката Дулиќ. Тоа е фирмата поврзана со Виста Процесинг, Мијалкови, НПК на Груевски','2016-04-05 16:10:00',22,157,8,187,'148427235188637'),('1120399217991429','http://sdsm.org.mk/News.aspx?idNews=1421&lng=1','Одговорна власт е само онаа која дозволува да биде контролирана самата. Тоа значи дека медиумите ќе бидат слободни, тоа значи дека не смее да помисли некој да се јави на судија и да му диктира пресуда. Тој што ќе се дрзне да го прави тоа, самиот ќе лежи затвор. Значи нема да има селективна правда и нема да има прошка и милост за никој, па ако сака нека биде претседател, премиер, министер, било што','2016-04-05 16:53:38',23,379,3,405,'148427235188637'),('1120455424652475','http://sdsm.org.mk/News.aspx?idNews=1424&lng=1','','2016-04-05 19:05:18',0,134,2,136,'148427235188637'),('1120508907980460','http://sdsm.org.mk/News.aspx?idNews=1425&lng=1','','2016-04-05 21:03:39',0,101,2,103,'148427235188637'),('1120846821280002','http://sdsm.org.mk/News.aspx?idNews=1428&lng=1','Медиумите се во уште полоша ситуација поради грозната пропаганда на оваа власт. Не може да се постигне договор за радиодифузниот сервис за да има избалансиран пристап. Приватните медиуми се купени од фамилијата, од бандата на Груевски. Тоа е така бидејќи Груевски се плаши од фер избори и сака да оди на избори без избор. Избори без избор се недемократски избори а на Македонија и требаат слободни, фер и демокартски избори со почитување на слободно изразената волја на граѓаните','2016-04-06 11:50:21',13,139,2,154,'148427235188637'),('1120916371273047','http://sdsm.org.mk/News.aspx?idNews=1429&lng=1','На Македонија и се потребни слободни и професионални државни институции кои ќе работат во интерес на граѓаните, а не во интерес на партијата на власт. Само депатризирани институции можат да водат бескомпромисна борба против криминалот и корупцијата што во Македонија има сериозни размери','2016-04-06 14:40:49',31,108,1,140,'148427235188637'),('1120965451268139','https://www.youtube.com/watch?v=ap4y3F3DYVA&feature=youtu.be','Нашиот предлог е да се избрише ставот во кој што се вели: Во контакната зона на старото градско јадро, поточно во контакната зона не смее да се врши земјени или други градежни работи без археолошки надзор, да се предвидуваат новоградби, сообраќајници и други градежни работи без археолошки истражувања на просторите за кои има и постојат археолошки локалитети','2016-04-06 15:49:53',12,41,0,53,'148427235188637'),('1120986044599413','http://sdsm.org.mk/News.aspx?idNews=1430&lng=1','Сакам да ве уверам дека погубниот начин на исплата на субвенциите ќе биде минато со промена на власта. Нашите заложби ќе бидат насочени кон редовна и навременена исплата на субвенциите тогаш кога ви се најпотребни, без разлика на вашата партиска припадност. Ние нема да ги делиме земјоделците на наши и ваши, секој што произведува чесно, ќе си ги добие овие пари што му следуваат со закон. Што се однесува до овие заостанати субвенции можам само да ви посочам да ги чувате белешките, ќе ви ги исплатиме веднаш по промената на оваа погубна власт','2016-04-06 16:37:14',3,63,1,67,'148427235188637'),('1121021404595877','https://www.facebook.com/zaevzoran/posts/10154175675282932','Обраќање на претседателот Заев во 19 часот во седиштето на партијата\n*Дополна: Најавеното обраќање се одложува, дополнително ќе ве известиме за времето.','2016-04-06 18:03:00',0,81,3,84,'148427235188637'),('1121060571258627','https://www.facebook.com/SDSMakedonija/photos/a.1121060224591995.1073742107.148427235188637/1121060571258627/?type=3','','2016-04-06 19:28:19',11,130,1,142,'148427235188637'),('1121067561257928','https://youtu.be/6OJ_sytHCMg','Бараме итна седница согласно Уставот на Република Македонија на којашто ќе бидат констатирани оставките на министрите и дополнителните заменици министри на опозицијата.','2016-04-06 20:00:00',6,22,0,28,'148427235188637'),('1121192187912132','http://sdsm.org.mk/News.aspx?idNews=1435&lng=1','Пренос во живо од прес конференцијата ќе може да следите на следниот линк','2016-04-06 23:11:56',7,52,2,61,'148427235188637'),('1121218721242812','http://sdsm.org.mk/News.aspx?idNews=1436&lng=1','Без слободни избори нема слобода! Демократијата ќе се врати и за неа ќе се избориме заедно со граѓаните. Или Груевски или Македонија!','2016-04-07 00:21:25',26,641,10,677,'148427235188637'),('1121556537875697','http://sdsm.org.mk/News.aspx?idNews=1437&lng=1','Пренос во живо од прес конференцијата ќе може да следите на следниот линк','2016-04-07 15:07:23',1,60,1,62,'148427235188637'),('1121577217873629','http://sdsm.org.mk/News.aspx?idNews=1438&lng=1','Повикувам, во Платформа за слободна Македонија да се приклучат: коалициските партнери на СДСМ, политичките партии, невладините организации, здруженијата, синдикатите, интелектуалците, професорите, вработените, невработените, целата демократска јавност, сите борци за слобода... Заедно со граѓаните да ја вратиме демократијата, да ја донесеме слободата','2016-04-07 15:54:49',21,513,7,541,'148427235188637'),('1122215244476493','http://sdsm.org.mk/News.aspx?idNews=1444&lng=1','Владата предводена од техничкиот премиер на ВМРО-ДПМНЕ направи ново прекршување на Договорот од Пржино.  Донесе против законска одлука за поништување на сите правни акти на министрите, донесени пред поднесување на оставките. Со ваквата одлука, ВМРО-ДПМНЕ и ДУИ ги прават изборите невозможни. Нема да дозволиме овој хаос да биде на штета на граѓаните.','2016-04-08 16:12:03',12,60,1,73,'148427235188637'),('1122266041138080','http://sdsm.org.mk/News.aspx?idNews=1446&lng=1','СДСМ и коалициските партнери се цврсто одлучни за заедничко и бескомрпомисно делување во одбрана на законското и уставното функционирање на државата, правдата, вистината, иднината на Република Македонија','2016-04-08 18:10:00',10,211,3,224,'148427235188637'),('1122880231076661','http://sdsm.org.mk/News.aspx?idNews=1448&lng=1','Со оваа Платформа за демократска Македонија СДСМ и коалициските партнери се обврзаа заедно и бескомпромисно да делуваат во одбрана на правдата, вистината, иднината!','2016-04-09 16:07:53',21,267,2,290,'148427235188637'),('1122972077734143','http://sdsm.org.mk/News.aspx?idNews=1449&lng=1','