та ќе може да следите на следниот линк','2016-04-12 17:56:56',11,46,0,57,'148427235188637'),('1124913960873288','http://sdsm.org.mk/News.aspx?idNews=1462&lng=1','Иванов денеска стана директен соучесник во злостроничкото здружување против Македонија. Го погазија Уставот, законите, достоинството на граѓаните, го погребаа договорот од Пржино. Јас, Зоран Заев, на чело на демократска Македонија, ќе ги предводам граѓаните во битката за враќање на уставниот поредок и државноста на Република Македонија, на улици, на протести, во градовите  и селата низ цела Македонија. Или Груевски или Македонија! Ќе победи Македонија!','2016-04-12 18:46:31',70,572,23,665,'148427235188637'),('1125345950830089','http://sdsm.org.mk/News.aspx?idNews=1464&lng=1','Целите на платформата се регуларни фер и демократски избори, владеење на правото, слободни медиуми, враќање на правната држава, департизација и деполитизција на институциите, зацврстување на начелата на еднаквост и рамноправност во нашето општество и враќање на власта во рацете на граѓаните.  Верувам дека сите заедно ќе застанеме во конечната борба за Македонија повторно да биде нормална, стабилна земја, да чекори исправено кон евроатланските интеграции','2016-04-13 12:27:21',4,108,2,114,'148427235188637'),('1125370924160925','https://www.facebook.com/zaevzoran/photos/a.243039092931.174852.66035312931/10154194100672932/?type=3','Заедно за слободна Македонија','2016-04-13 13:40:37',0,7,0,7,'148427235188637'),('1125389077492443','http://sdsm.org.mk/News.aspx?idNews=1466&lng=1','Бараме Собранието на Република Македонија да биде свикано за покренување на постапка за утврдување на одговорност на Ѓорге Иванов. Ги повикуваме сите парламентарни партии да ја поддржат оваа иницијатива и да преземат чекор за враќање на уставниот поредок во Република Македонија. Иванов е директен учесник во злосторничкото здружение против Република Македонија. Македонија нема да дозволи да биде поразена. Или Груевски или Македонија. Ќе победи Македонија!','2016-04-13 14:23:04',58,477,10,545,'148427235188637'),('1125415014156516','https://www.facebook.com/SDSMakedonija/photos/a.415779518453406.95917.148427235188637/1125414987489852/?type=3','','2016-04-13 15:20:47',9,744,7,760,'148427235188637'),('1125572444140773','http://www.sdsm.org.mk/News.aspx?idNews=1468&lng=1','','2016-04-13 19:27:57',0,100,2,102,'148427235188637'),('1126069764091041','http://sdsm.org.mk/News.aspx?idNews=1472&lng=1','Борејќи се за регуларни, фер и демократски избори, испраќаме заедничка порака дека ова е првиот чекор кон нормализација на државата. Но надежите дефинирани во начелата како враќање на правдата, правната држава, професионализација на полицијата, департизација и деполитизација на институциите, вредностите од аспект на еднаквоста и рамноправноста на граѓаните се сериозни пораки зад коишто сите застануваме и се здружуваме','2016-04-14 14:02:44',16,392,2,410,'148427235188637'),('1126106924087325','http://sdsm.org.mk/News.aspx?idNews=1477&lng=1','Апелирам да нема насилство на протестите, да нема состојби на уништување на имот, државен или приватен, да нема напад врз полицијата, заради тоа што полицијата е тука да ја зачува безбедноста и стабилноста. Полицијата мора да постапува согласно стандардните процедури, не смее да има прекумерна употреба на сила и во тој правец и сега разговаравме навистина, колку е можно, сите кои присуствуваат да бидат заштитени и на еден начин се одржува редот на овие протести','2016-04-14 15:40:22',20,474,15,509,'148427235188637'),('1126704487360902','https://www.facebook.com/zaevzoran/photos/a.243039092931.174852.66035312931/10154198858112932/?type=3','','2016-04-15 15:24:02',0,56,1,57,'148427235188637'),('1126728057358545','https://www.facebook.com/zaevzoran/posts/10154198969452932','Во 17 часот обраќање на претседателот Zoran Zaev во седиштето на партијата. Пренос во живо (Live streaming) можете да следите на www.sdsm.org.mk','2016-04-15 16:20:08',0,44,0,44,'148427235188637'),('1126767720687912','http://www.sdsm.or