4893722510'),('617443931664268','http://gurra-pdsh.org/index.php?option=com_content&view=article&id=377%3Aali-ahmeti-p%C3%ABrkrah-car-dushanit-si-m%C3%AB-meritori-p%C3%ABr-projektin-shkupi-2014&catid=87%3Anga-vendi&Itemid=739','','2014-04-25 19:42:25',0,19,1,20,'130194893722510'),('617455401663121','http://shqipmedia.com/portal/tubimi-perfundimtar-madheshtor-i-pdsh-se-foto-dhe-video/','','2014-04-25 20:14:30',40,257,5,302,'130194893722510'),('617935398281788','https://www.facebook.com/pdsh.info/photos/a.133021743439825.31964.130194893722510/617934704948524/?type=3','Lideri i Partisë më të madhe të shqiptarëve  z. Menduh Thaçi \nVoto 2 ...për liri!','2014-04-26 20:53:22',18,395,3,416,'130194893722510'),('618270244914970','http://shqipmedia.com/portal/?p=87509','','2014-04-27 14:04:10',1,128,3,132,'130194893722510'),('619316578143670','http://lajmpress.com/opinion/31924.html','Pse e votuan shqiptarët në numër aq të madh për BDI-në?\n\nSepse, gjatë mandatit të qeverisë së BDI-së me VMRO-DPMNE-në, u ndërtua “Shkupi 2014”, u botua enciklopedia e Akademisë maqedonase, u sollën shumë investime të huaja në pjesën maqedonase, dhe thuajse asnjë investim i huaj në pjesën shqiptare. Për shkak se gjatë mandatit të tyre, u vranë shumë ish komandantë dhe ushtarë të UÇK-së, gjë që nga shumë maqedonas konsiderohet si revansh i suksesshëm për humbjen që pësuan në luftën e vitit 2001.\n\nBDI fitoi për shkak se gjatë mandatit të tyre u bënë investimeve qindra milionëshe për kulturën maqedonase dhe thuajse asnjë investim i rëndësishëm për kulturën shqiptare. Për shkak se gjatë mandatit të tyre për arsimin maqedonas ndahen shumëfish më shumë mjete se për arsimin shqip, kurse e njëjta ndodh edhe me bujqësinë. U votua BDI për numrin shumëfish më të madh të maqedonasve që punësohen, dhe për ndaljen e hovit të punësimeve të shqiptarëve. U votua edhe për shkak të ofendimeve, që sipas WikiLeaksit i shpreh kushëriri i Gruevskit Sasho Mijallkov ndaj funksionarëve të BDI-së, për shkak të refuzimit të VMRO-së pranojë kandidat konsensual për president, për heqjen e tabelës në gjuhën shqipe nga Galeria e arteve në Shkup, për anashkalimin e gjuhës shqipe në promovimin e punimeve në magjistralen Kërçovë-Ohër. U votua sepse nënciklet zgjedhore parlamentare nga 6 deputetë të diasporës, asnjëris’është shqiptarë! http://lajmpress.com/opinion/31924.html','2014-04-29 15:29:37',14,89,5,108,'130194893722510'),('619317771476884','http://shqipmedia.com/portal/?p=87850','','2014-04-29 15:33:50',3,59,10,72,'130194893722510'),('619815304760464','http://shqipmedia.com/portal/?p=88037','','2014-04-30 18:11:29',11,125,5,141,'130194893722510'),('620778454664149','http://shqipmedia.com/portal/kryetari-i-pdsh-se-ne-takim-me-ambasadorin-amerikan-wohlers-video/','','2014-05-02 17:55:36',1,83,1,85,'130194893722510'),('620925951316066','http://shqipmedia.com/portal/?p=88183','Pas intervistës së Ali Ahmetit dhënë për mediat nëë Shqipëri, ku mes tjerash kryetari i BDI-së thotë se ka komunikim mes partisë së tij dhe Partisë Demokratike Shqiptare të Menduh Thaçit, e ka demantuar sot nënkryetari i PDSH-së Ernad Fejzullahu i cili për portalin Shqipmedia deklaron:','2014-05-03 00:04:02',5,66,1,72,'130194893722510'),('621158827959445','http://shqipmedia.com/portal/?p=88226','','2014-05-03 14:24:09',5,62,0,67,'130194893722510'),('621159607959367','http://shqipmedia.com/portal/?p=88229','','2014-05-03 14:27:02',5,57,0,62,'130194893722510'),('621262501282411','http://shqipmedia.com/portal/?p=88273','','2014-05-03 19:44:04',4,18,0,22,'130194893722510'),('621671751241486','http://shqipmedia.com/portal/ziadin-pushteti-te-verboi/','Opinon nga Azem Sadiku','2014-05-04 15:43:51',0,33,1,34,'130194893722510'),('622125787862749','http://shqipmedia.com/portal/pdsh-si-bdi-ashtu-edhe-alsat-m-ne-panik%e2%80%8f-video/','Të tërbuar nga antishqiptarizmi dhe nga qëndresa e fuqishme e PDSH-së, BDI-ja dhe LSDM-ja nëpërmjet një portali paçavure “Libertas” e veçmas Alsat-M, nuk zgjedhin mënyra me shpifje e vrer për 