p=6355','','2015-03-21 20:51:02',4,66,0,70,'130194893722510'),('794358450639481','http://www.ditari.mk/?p=6434','Kryetari i Partisë Demokratike Shqiptare, z.Menduh Thaçi, takoi Ambasadorin e Turqisë','2015-03-25 14:10:41',1,44,0,45,'130194893722510'),('794950987246894','http://ina-online.net/index.php?news=53244','','2015-03-26 22:15:01',4,39,0,43,'130194893722510'),('794992687242724','http://www.ditari.mk/?p=6500','','2015-03-27 00:16:26',0,15,0,15,'130194893722510'),('798031236938869','https://www.facebook.com/pdsh.info/photos/a.597807260294602.1073741826.130194893722510/798031123605547/?type=3','Kryetari i PDSH-së realizoi takim me Kryeministrin shqiptar, z.Edi Rama\n\nKryetari i Partisë Demokratike Shqiptare, z.Menduh Thaçi, sot ka realizuar një vizitë zyrtare në Tiranë, me ç’rast u takua me Kryeministrin e Republikës së Shqipërisë, z.Edi Rama.\n\nNë takim është biseduar për çështje me rëndësi për shqiptarët, për zhvillimet e fundit politike në Maqedoni, Shqipëri dhe më gjerë, për procesin integrues të të dy vendeve, si dhe për tema të tjera me interes të përbashkët.\n\nKryetari Thaçi ka informuar kryeministrin shqiptar për situatën aktuale politike në vend, bllookimin e proceseve integruese, si dhe për diskriminimin politik dhe ekonomik të shqiptarëve, gjë që ka varfëruar skajshmërish shqiptarët e Maqedonisë.\n\nKryeministri i Shqipërisë z.Rama falënderoi kryetarin e PDSH-së për informatat burimore rreth zhvillimeve në Maqedoni, duke potencuar se Qeveria e Shqipërisë ndjek me vëmendje të veçantë situatën aktuale politike në Maqedoni.\n\nTakimi kaloi në një atmosfere tejet miqësore, me ç’rast bashkëbiseduesit shkëmbyen mendime rreth zhvillimeve aktuale në vend dhe rajon, si dhe rënë dakord që me kontakte të shpeshta të kontribuojnë në çuarjen para të proceseve demokratike.','2015-04-02 11:38:49',2,94,0,96,'130194893722510'),('801626759912650','https://www.facebook.com/275355619167100/photos/a.363997486969579.74789.275355619167100/838593619509961/?type=3','','2015-04-09 19:15:56',0,37,0,37,'130194893722510'),('807177946024198','http://www.ditari.mk/?p=7000','','2015-04-20 23:13:22',1,44,0,45,'130194893722510'),('808587989216527','http://www.ditari.mk/?p=7105','Me çka i meritoi PDSH-ja sulmet e disa publicistëve, portaleve, mediave dhe intelektualëve shqiptarë?','2015-04-23 13:53:41',0,29,1,30,'130194893722510'),('808705045871488','http://www.ditari.mk/?p=7111','Kryetari i PDSH-së priti në takim Grupin e Punës të Këshillit Evropian për rajonin e Ballkanit Perëndimor (COWEB)','2015-04-23 18:56:42',0,30,0,30,'130194893722510'),('815597591848900','https://www.facebook.com/pdsh.info/photos/a.133021743439825.31964.130194893722510/815597591848900/?type=3','Mos cenoni jetën dhe pronën e qytetarëve\n\nPartia Demokratike Shqiptare me vëmendje ndjek zhvillimet e reja të situatës në Kumanovë dhe apelon deri tek qytetarët që ta ruajnë qetësinë dhe në asnjë mënyrë të mos bien pre e provokimeve.\nPartia Demokratike Shqiptare, konform pozicionit momental politik që ka si opozitë, kërkon nga Ministria e Punëve të Brendshme si dhe institucionet e tjera qeveritare të involvuara në këtë situatë, që me veprimet e tyre në asnjë mënyrë të mos cenojnë jetën dhe pronën e qytetarëve.\nPartia Demokratike Shqiptare ka potencialin dhe aftësinë politike që pakënaqësitë e akumuluara ti artikulojë me metoda politike dhe ti mbrojë interesat e shqiptarëve të Maqedonisë si dhe apelon që shqiptarët të mos bëhen pjesë e skenarëve të individëve dhe grupeve të ndryshme me agjendë dhe qëllime të cilat nuk përkojnë me metodat me të cilat shqiptarët do të donin të zgjidheshin problemet e tyre.\nApelojmë tek faktori ndërkombëtarë që urgjentisht të ndërhy në këtë situatë me qëllim të parandalimit të përshkallëzimit të mëtutjeshëm të situatës.','2015-05-09 12:55:08',1,45,2,48,'130194893722510'),('816728848402441','http://lajmpress.com/lajme/maqedoni/56900-pdsh-rruga-e-shqiptareve-eshte-rruga-e-shba-ve-nato-s-dhe-be-se.html','PDSH: Rruga e shqiptarëve është rruga e SHB